(120, 'A Quartette Christmas', ' <strong> A Quartette Christmas</strong> <br><p><strong>Presented by: Shantero Productions<br> Centrepointe Theatre<br>   Thursday,  December 22, 2016 at 7:30 p.m.<br></strong><p>One of the great joys of Christmas is the music … one of the great joys of this Christmas is the opportunity to experience that music through the genius of Quartette! Whether it’s traditional favourites like “Silent Night” and “What Child Is This?” or Quartette originals such as “The Perfect Christmas Tree” and “Hope, Peace, Joy and Love”, Canadian singer/songwriters Cindy Church, Caitlin Hanford, Gwen Swick and Sylvia Tyson enchant with their singularly lush harmonies, unique arrangements and rich variety of musical influences.<br><br>The genesis of Quartette was happenstance … a “songwriter in the round” showcase of Canadian women songwriters hosted by Toronto’s Harbourfront Centre in 1993. What began as a concert of musical friends grew into an inspired collaboration, generating public and critical acclaim, and catching the ear of Peter Gzowski, who invited them to perform on his CBC Radio show Morningside. Later Gzowski would say of that performance: “The CBC switchboard lit up like a Christmas tree with people looking for a recording!” Seven months later they released their self-titled album. Since then, Quartette has released five more recordings – two of them Christmas collections, garnered multiple Juno nominations, won the Canadian Country Music Award for best vocal collaboration, performed with major symphonies across Canada, been repeat guests on Garrison Keillor’s A Prairie Home Companion, recorded a CMT-TV Christmas special and of course continued to tour the country, either in support of their most recent release or for their ever-popular Christmas performances.<br><br>Laughter, refreshing arrangements of old and new, impeccable harmonies, tales of love and inspiration, four lovely ladies celebrating 23 years of musical friendship … “A Quartette Christmas.” <br><p><strong>Genre: </strong>Music, Holiday<br><strong>Language: </strong>English<br><strong>Tickets: </strong>$47.50 <br><a></a><p><a href="http://ev7.evenue.net/cgi-bin/ncommerce3/SEGetEventInfo?ticketCode=GS%3ACP%3AC1617%3ACT1222C%3A&linkID=centrepointe&shopperContext=&pc=&caller=&appCode=&groupCode=CCPT&cgc=" rel="nofollow">December 22 at 7:30 pm</a><br></p></p></p></p>', 'http://ottawa.eventful.com/events/quartette-christmas-/E0-001-074026656-7?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, NULL);
