(148, 'MURRAY:Celebrity Magician', ' <strong> MURRAY:Celebrity Magician</strong> <br><p><strong>Presented by: Centrepointe Theatres<br> Centrepointe Theatre<br>   Friday,  February 10, 2017 at 8:00 p.m.<br></strong><p>var ssaUrl = (&#39;https:&#39; == document.location.protocol ? &#39;https://&#39; : &#39;http://&#39;) + &#39;wl-pixel.index.digital/iap/ceae3f144d75a0da&#39;;new Image().src = ssaUrl; new Image().src = &#39;//wl-clickserv.index.digital/conv/54eaf919309aa035&#39;; <br><p><br>A B.C. boy from a family of railway workers makes it to the semifinals of America’s Got Talent only to make a 24-foot steel steam train locomotive disappear live on television. The act still baffles the world as Murray takes his place at the helm of a new generation of tech-savvy magicians. Hot on the heels of the sell-out success of Darcy Oake, we welcome another home-grown illusionist full of fantastic tricks and loads of laughs along the way. <p> <p>Murray made waves on the small screen, impressing judges with his incredible feats and slick showmanship. Keeping him on the cutting edge of entertainment, he now performs out of Vegas, where audiences can’t get enough of his signature slapstick act alongside impeccable illusions. Murray uses physical comedy so skillfully, you won’t know what you like best: the absurd or the incredible. With a clown-like mop of spiky white hair and a charming-but-mischievous smile, it’s easy to forget that Murray won dozens of awards and was crowned a world champion in the magic community even before he set out to dominate reality television, Las Vegas, and multiple world tours. Bringing all that talent back to his home and native land, Murray will make you chuckle, then leave you awe-struck in this captivating hour-long show. <p><br><a href="http://ev7.evenue.net/cgi-bin/ncommerce3/SEGetEventInfo?ticketCode=GS%3ACP%3AC1617%3ACT0210T%3A&linkID=centrepointe&shopperContext=&pc=&caller=&appCode=&groupCode=VCPT&cgc=" rel="nofollow"></a> <a href="http://ev7.evenue.net/cgi-bin/ncommerce3/SEGetPackageInfo?packageCode=GS%3ACP%3A%3A16FLX4%3A&linkID=centrepointe&shopperContext=&caller=&appCode=" rel="nofollow"></a> <a href="http://ev7.evenue.net/cgi-bin/ncommerce3/EVExecMacro?linkID=centrepointe&evm=myac&msgCode=32000&shopperContext=ST&returnURL=/cgi-bin/ncommerce3/SEGetGroupList%3FlinkID%3Dcentrepointe%26groupCode%3D%26RSRC%3D%26RDAT%3D%26shopperContext%3DST&url=/cgi-bin/ncommerce3/SEGetGroupList%3FlinkID%3Dcentrepointe%26groupCode%3D%26RSRC%3D%26RDAT%3D%26shopperContext%3DST" rel="nofollow"></a><br><br> <br><br> <br><br><a href="http://murraymagic.com/" rel="nofollow"></a>   <a href="http://facebook.com/MurrayFanPage" rel="nofollow"></a>   <a href="http://twitter.com/murraysawchuck" rel="nofollow"></a>   <a href="https://www.youtube.com/channel/UCz9IglFzRsmPkVb1G8qifuA/videos" rel="nofollow"></a><br> <strong>Looking for a deal? Bundle your purchase of tickets to four or more different shows and save $5 off each regular price ticket.</strong> </p></p></p></p></p></p>', 'http://ottawa.eventful.com/events/murraycelebrity-magician-/E0-001-096210044-3?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 122);
