(159, 'Havoc 11 Fighting Chamionship', ' Event details were provided by event coordinator and may change without notice. Paid parking may be in effect during this event.<p><strong>Westerner Park Box Office - Hours of Operation</strong><br>Concert Days - 9:00 AM<br>Red Deer Rebels Game Days - 11:00AM<p>All event tickets may be purchased at <a href="http://www.ticketmaster.ca/search?tm_link=tm_homeA_header_search&vid=139380&user_input=enmax&q=Enmax+Centrium" rel="nofollow">Ticketmaster.ca</a> or charge by phone at <a>1.855.985.5000</a> <strong>One Time Entry</strong><br> $5.00 per vehicle<p><strong>Weekend Passes</strong><br> 4 days: $16.00 <br>3 days: $12.00 <br>2 days: $8.00</p></p></p>', 'http://eventful.com/events/havoc-11-fighting-chamionship-/E0-001-097264013-5?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 63);
