(223, 'Microsoft Excel 2010: Level 3 (Exam 77-882)', ' Microsoft® Office Excel® 2010: Level 3 (Second Edition) Course Specifications – Course number: 084678 Course length: 1.0 day(s) Certification: MOS: Microsoft Office Excel 2010, MOS: Microsoft Office Excel 2010 Expert Exam:  General 77–882, Expert 77–888 Note: Includes all Course Materials and a partial Voucher toward the Exam Course Description – Course Objective: You will automate some common Excel tasks, apply advanced analysis techniques to more complex data sets, troubleshoot errors, collaborate on worksheets, and share Excel data with other applications. Target Student: This course was designed for students desiring to gain the skills necessary to create macros, collaborate with others, audit and analyze worksheet data, incorporate multiple data sources, and import and export data.  Prerequisites: To ensure your success, we recommend that you first take the following courses or have equivalent knowledge:   Microsoft® Office Excel® 2010: Level 1 (Second Edition) Microsoft® Office Excel® 2010: Level 2 (Second Edition)   Certification:   This course is one of a series of courseware titles that addresses Microsoft Office Specialist (MOS) certification skill sets. The MOS and certification program is for individuals who use Microsoft&#39;s business desktop software and who seek recognition for their expertise with specific Microsoft products. Course Objectives – Upon successful completion of this course, students will be able to: Enhance productivity and efficiency by streamlining the workflow. Collaborate with other workbook users. Audit worksheets. Analyze data. Work with multiple workbooks. Import and export data. Integrate Excel data with the web. Course Content – Lesson 1: Streamlining Workflow Topic 1A: Update Workbook Properties Topic 1B: Create a Macro Topic 1C: Edit a Macro Topic 1D: Apply Conditional Formatting Topic 1E: Add Data Validation Criteria Lesson 2: Collaborating with Other Users Topic 2A: Protect Files Topic 2B: Share a Workbook Topic 2C: Set Revision Tracking Topic 2D: Review Tracked Revisions Topic 2E: Merge Workbooks Topic 2F: Administer Digital Signatures Topic 2G: Restrict Document Access Lesson 3: Auditing Worksheets Topic 3A: Trace Cells Topic 3B: Troubleshoot Invalid Data and Formula Errors Topic 3C: Watch and Evaluate Formulas Topic 3D: Create a Data List Outline Lesson 4: Analyzing Data Topic 4A: Create a Trendline Topic 4B: Create Sparklines Topic 4C: Create Scenarios Topic 4D: Perform a What-If Analysis Topic 4E: Perform a Statistical Analysis with the Analysis ToolPak Lesson 5: Working with Multiple Workbooks Topic 5A: Create a Workspace Topic 5B: Consolidate Data Topic 5C: Link Cells in Different Workbooks Topic 5D: Edit Links Lesson 6: Importing and Exporting Data Topic 6A: Export Excel Data Topic 6B: Import a Delimited Text File Topic 6C: Import and Export XML Data Lesson 7: Integrating Excel Data with the Web Topic 7A: Publish a Worksheet to the Web Topic 7B: Import Data from the Web Topic 7C: Create a Web Query Appendix A: Creating Excel Forms ', 'http://eventful.com/events/microsoft-excel-2010-level-3-exam-77882-/E0-001-096090618-0?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 67);
