(238, 'Café-croissants Ulule: Découvrir la chouette aventure du sociofinancement', ' Vous chérissez un rêve, une cause, un projet culturel, social, entrepreneurial et avez envie qu&#39;il voit le jour...  Mais vous avez besoin de ressources pour le faire éclore. Que faire? Vous avez entendu bien des choses à propos du crowd-socio-machin-participa-truc dont tout le monde parle. Ça fonctionne vraiment?  Ulule vous offre une rencontre inspirante sur le sociofinancement: 1h30 remplies d&#39;exemples, de trucs et conseils pour découvrir, comprendre et réussir une campagne de sociofinancement. Après tout, la plateforme Ulule a permis de financer plus de 14 500 projets, pourquoi pas le vôtre? Ce mardi, un petit café qui pourrait tout changer... Et c&#39;est gratuit! Vous y serez? ', 'http://montreal.eventful.com/events/cafcroissants-ulule-dcouvrir-la-chouette-aventu-/E0-001-096435615-2?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 122);
