(249, 'The Rocky Horror Picture Show', ' <br> The Rocky Horror Picture Show is the 1975 film adaptation of the British rock musical stageplay, The Rocky Horror Show, written by Richard O&#39;Brien. The film is a parody of B-movie, science fiction and horror films of the late 1940s through early 1970s. Director Jim Sharman collaborated on the screenplay with O&#39;Brien, who wrote both the book and lyrics for the stage. The film introduces Tim Curry and features Susan Sarandon and Barry Bostwick along with cast members from the original Kings Road production presented at the Royal Court Theatre, London, in 1973.Still in limited release nearly 37 years after its premiere, it has the longest-running theatrical release in film history. It gained notoriety as a midnight movie in 1977 when audiences began participating with the film in theatres. Rocky Horror is the first film from a major Hollywood studio to be in the midnight movie market. The motion picture has a large international cult following and is one of the most well known and financially successful midnight movies of all time. In 2005, the film was selected for preservation in the United States National Film Registry by the Library of Congress as being &quot;culturally, historically, or aesthetically significant&quot;.', 'http://eventful.com/winnipeg/events/rocky-horror-picture-show-/E0-001-097321694-4?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 37);
