(307, 'Souper-Spectacle bénéfice Carole Lévesque', ' Il s&#39;agit d&#39;un souper spaghetti afin d&#39;amasser des fonds pour Carole, ma maman, atteinte d&#39;un cancer. Ce sera aussi l&#39;occasion de lui démontrer qu&#39;à travers chaque épreuve plus difficile, se cache de l&#39;espoir et du courage. Cette surprise est une façon de lui montrer qu&#39;elle n&#39;est pas seule. Par ailleurs, ce sera une super soirée pour tous les invités. Spectacle pendant le souper et danse par la suite ! Différents tirages se feront également au courant de la soirée. Vous pouvez également apportez votre vin. Venez en grand nombre, il s&#39;agit d&#39;un événement ouvert à tous. ', 'http://montreal.eventful.com/events/souperspectacle-bnfice-carole-lvesque-/E0-001-096776668-8?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 44);
