(319, 'Coastal City Ballet Presents: Fall for Ballet', ' <p><strong>Presented by:</strong> Coastal City Ballet<br><strong>Date: </strong>November 26th, 2016 at 8pm, in the Grosvenor Theatre at the Kay Meek Centre<br><strong>Tickets:</strong> $30 Adults, $22 Seniors/Students/Children, $20 Groups of 10+ (per ticket)<p>With acclaimed and sold out shows last spring, Coastal City Ballet opens its 6th season with Fall for Ballet. Vancouver’s premiere repertory ballet company features locally trained and international dancers in an affordable and family-friendly evening of mixed ballet repertoire. The evening includes End of Time, from the gold medal winning choreographer Ben Stevenson (OBE) and Marius Petipa’s elegant Jardin Anime, an excerpt from the classic Le Corsaire, complete with tutus. Also, Li Yaming, Coastal City Ballet’s Artistic Director brings two works: Tango, set to Astor Piazzolla, and Drum Roll, a powerful all-male work displaying synchronicity and balletic skill. These pieces and more will have you falling for ballet all over again this fall! <br></p></p>', 'http://vancouver.eventful.com/events/coastal-city-ballet-presents-fall-ballet-/E0-001-096892899-3?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(320, 'JESSIE FARRELL: FREE COMMUNITY EVENT', ' <p> JESSIE FARRELL<br> Monday, February 13th, 2017 at 2:00pm<br> Family Day<br>  West Vancouver Community Centre<br> Free Admission<p> Featuring the music from her children&#39;s music album, &quot;Take Me Outside&quot;.<br> The catchy and whimsical songs are featured in a kids&#39; CBC television series &quot;Scout & The Gumboot Kids.&quot; Inspired by motherhood and her own children&#39;s imagination, Jessie has expanded from her award-winning country music roots to lively musical storytelling for her young fans!</p></p>', 'http://vancouver.eventful.com/events/jessie-farrell-free-community-event-/E0-001-097017643-2?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
