(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(321, 'Basic Agility', ' Basic Agility Overview<br>Mark your calendars for Basic Agility!  Nov 3, 2016 to Nov 25, 2016<br> 12:00PM to 7:30PM<br> Admission: $3.95<br><br>Join us at PawsWay for our Drop-in Agility program! Obstacles and socialization make for the best way to exercise the mind and muscle for your pet! Lasts all winter long to the new year! $3.50+HST per day. Visit us at www.pawsway.ca for more details!  For more information, please call 416-360-PAWS(7297) or email <a href="http://www.bringfido.com/cdn-cgi/l/email-protection" rel="nofollow">[email protected]</a>', 'http://toronto.eventful.com/events/basic-agility-/E0-001-097266064-3?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 90);
