(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(322, 'Human Rights Professional Development Training Program for York Managers', ' <br><strong>Location:</strong> 280N York Lanes <br><br>Dec 15, 2016, 10am-11am<p><p>The Human Rights Professional Development Training Program consists of one-hour training sessions.<p><strong>Employment Equity & Retention Practices</strong><p>In this workshop, managers will receive an overview of the goals and principles of the Employment Equity program at York University. Participants will have the opportunity to develop retention strategies relevant to their workplace to support the professional development of their staff.</p></p></p></p>', 'http://toronto.eventful.com/events/human-rights-professional-development-training-p-/E0-001-097256376-6?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 29);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(323, 'Human Rights Professional Development Training for York Staff and Graduate Students', ' <br><strong>Location:</strong> A226 Glendon campus <br><br>Oct 26, 2016, 1pm-2pm<p><p>The Human Rights Professional Development Training Program consists of one-hour training sessions.<p><strong>Employment Equity & Race</strong><p>In this workshop, participants will receive an overview of the goals and principles of the Employment Equity program at York University. Participants will gain an understanding of the impact of microaggressions and implicit bias on racial equity in the workplace and obtain tips on reducing and eliminating these barriers. </p></p></p></p>', 'http://toronto.eventful.com/events/human-rights-professional-/E0-001-097256701-8@2016111500?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 29);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(324, 'Human Rights Professional Development Training for York Work Study Students', ' <br><strong>Location:</strong> 956 Kaneff Tower <br><br>Jan 26, 2017, 1pm-2pm<p><p>At the end of the workshop, participants will:<ul><li>have an understanding of the Ontario Human Rights Code (1962) and its implications for building a respectful workplace culture; <li>be able to discuss key human rights terms and definitions and apply this information in potential workplace case scenarios; and <li>be able to share best practices and strategies for providing inclusive and equitable services. </li></li></li></ul></p></p>', 'http://toronto.eventful.com/events/human-rights-professional-development-training-y-/E0-001-097256363-2?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 29);
