(329, 'WED AFTER SCHOOL SPECIAL - $1 Off Perogies - 5pm to 10:30pm', ' Presented by: House of TARG, PBR<br>$1 off Perogies: 5pm - 10:30pm<br>Cover: ZERO DOLLARS ALL NITE / ALL AGES<p><strong>WEDNESDAY PEROGI DEALS - 5pm - 10:30pm</strong><br>Wednesdays can be a real struggle so we are helping out by knocking off $1 from each of our <a href="http://www.houseoftarg.com/perogies-menu" rel="nofollow">6 varieties of delicious Perogies</a>. Experience Perogi Power!<p><strong>ARCADE IS OPEN EVERY WEDNESDAY - 5pm - 11pm</strong><br>We have all of your favourite Vids & Pinball Machines, like we are talking over 100 playable titles and our eclectic collection is always changing. <a href="http://www.houseoftarg.com/pinball-classic-arcade-game" rel="nofollow">Check out the games list!</a><p><strong>ABSOLUTELY NO COVER*</strong><br>Yep - Wednesday is about eating Perogies, playing Pinball and hanging out with your family & pals<strong>.</strong><p><strong>* on occasion we will book rad bands on Wednesday to which a cover charge will be applied after 9pm. Please consult our <a href="http://www.houseoftarg.com/concert-listings-events" rel="nofollow">Event Listings</a>.</strong></p></p></p></p>', 'http://ottawa.eventful.com/events/wed-after-school-special-1-off-perogies-5pm-103-/E0-001-097161189-9?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, NULL);
