VALUES
(336, 'Clela Errington', ' <br> Clela Erringtons voice is timeless and true, effortlessly reaching beyond technique and trends to wrap you in a warm soul embrace. Her new album More Love and Happiness is a vibrant blend of folk, jazz, and African influences that creates the perfect vehicle for Clelas intimate and dynamic vocal delivery.A classic late bloomer, Clela produced her first of four independent albums at the age of 43. As an artist, she is inspired by the beauty and power of the natural world, particularly the geography of her childhood home in the Thousand Islands region of the St Lawrence River.Before settling down in Toronto, Clela spent five years living on Canadas east coast, performing in P.E.I., New Brunswick, Nova Scotia and Newfoundland. Clela`s harmonica composition Lace Curtains was awarded Best Instrumental honourable mention in the Ontario Council of Folk Festivals Songs from The Heart.Throughout 2011, Clela performed in a duo with drummer John Adames (Prairie Oyster, BeBop Cowboys, Brothers Cosmoline). In 2012, Clela began singing with the womens choir, Essentia Vocal Ensemble. Their collective of singers and instrumentalists includes many of the bright lights on the music scene in Ontario. ~ www.essentiamusic.comIn 2014, Clela released a new album of original songs, More Love and Happiness, produced by Juno award winner Alec Fraser, bass player and producer for the late Jeff Healey. More Love and Happiness features multi-instrumentalist Chris Bartos and vocalist Jocelyn Barth.Currently Clela performs in an effervescent duo with her daughter Jocelyn Barth, offering up songs that highlight their shared artistry, impressive vocal range, and stunning improvisational skills.', 'http://toronto.eventful.com/events/clela-errington-/E0-001-097238691-8?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, NULL);
