(337, 'DEFYING GRAVITY: A Mega Musical Cabaret (FRIDAY)', ' <br><br>Date: <br><br>Friday, November 25, 2016<br><br>Time: <br><br>7:00 PM (Doors Open), 8:00 PM (Curtain)<br><br>Ticket Price: <br><br>$30 Orchestra || $20 Balcony <br><br><p>Join MTP for an evening of Broadway’s Biggest Blockbusters . . .<p><a href="https://apps.vendini.com/ticket-software.html?t=tix&e=c35b4dc00273ed667d67ca01a79846ee&vqitq=5e73baa2-4c96-4b71-b867-ac90f01fe4de&vqitp=0ed9f999-9b95-4f18-896b-f8983b980f88&vqitts=1474393737&vqitc=vendini&vqite=itl&vqitrt=Safetynet&vqith=8afd43d48e694e3c0daa12167e1f348b" rel="nofollow">Orchestra Tickets  - $30 (plus service charge)</a> Clink link to reserve tables for either Friday or Saturday&#39;s pefromances<br><a href="https://apps.vendini.com/ticket-software.html?t=tix&e=552830f13e0f0045bde9b79751d0cc74&vqitq=18e2c5bd-858b-4760-885a-c622c6f029d7&vqitp=e96908a9-979a-4153-b9a8-87987c9a6013&vqitts=1474477860&vqitc=vendini&vqite=itl&vqitrt=Safetynet&vqith=2745b720e96c0a5a81dd5b33d9f4be2d" rel="nofollow">Balcony Tickets - $20 (plus service charge)</a> Click link to get general admission balcony seats for either Friday or Saturday&#39;s Pefromance.<br><br> <p>&quot;Join MTP for an afternoon of Broadway&#39;s biggest blockbusters...&quot;<p>SHOWTIMES: Friday November 25 at 8pm and Saturday November 26 at 2pm AND 8pm. <p>Evening Shows: Doors open: 7:00pm || Curtain: 8:00pm<br>Matinee Show: Doors open: 1:00pm || Curtain: 2:00pm <p>Cash Bar and Silent Auction<p>Dress Code: Cocktail Attire<p><em>DEFYING GRAVITY</em> journeys into Broadway’s biggest musicals.  This mega musical cabaret features music from <em>The Phantom of the Opera, Les Misérables, Cats, Wicked</em> and more with a very special select children’s performance with music from <em>Annie</em>.  Join us for a night filled with classic and beautiful Broadway hits. <p>Following our last two sold-out presentations of<em> Night of Noir</em> and <em>Dare to Dream</em>, join us once again as we launch MTP’s 2016-2017 season with this two-night only benefit.  Dress up in your finest cocktail attire, meet for drinks before the show and bid on one of the exciting prizes in our silent auction.  All proceeds will be put toward the coming season and the continuation of our mission to nourish local talent and inspire a passion for musical theatre.  <p>CAST<p>Sarah Abbott<br>Matty Angelopoulos<br>Thaesha Buckley <br>Andrew Cherry <br>Preston Cooper-Winder <br>Susan Dean<br>Riley DeLuca<br>Kate Deman<br>Andrea Ferrett <br>Leah Gliddon <br>Katie Harris<br>Jesslyn Hodgson<br>Evan Jones <br>Sophie Jones<br>Allison Lattanzio <br>Olivia Little <br>Shannon Maguire<br>Chase Martin-Lee <br>Ruth Noonan<br>Sarah Ouellet<br>Bronwyn Powell<br>Alana Rapacz<br>John Rapacz<br>Julia Sebastien<br>Amber Sellars <br>Ava Silcox<br>Rick Smith <br>Shae Solomon<br>Lindsay Stocks<br>Emma Vanderkuyl<br>Terence Vince<br>Braven Warren <br>Grace Worsley <br>Daniel Wyzynski<br>Luke Lee Young<p>ARTISTIC TEAM<p>Director: Kristina Baron-Woods<br>Music Director: Alexandra Kane<br>Producer: Sue McKone<br>Production Manager: Duane Woods<br>Stage Manager: Kristen Scott<p><p>About Musical Theatre Productions: Musical Theatre Productions (MTP) is a non-profit, charitable organization formed in 1988 in London, Ontario. MTP stages several productions and other musical events each year, and has produced over 60 musicals for the enjoyment of London audiences. For more information, visit mtplondon.ca.</p></p></p></p></p></p></p></p></p></p></p></p></p></p></p>', 'http://eventful.com/events/defying-gravity-mega-musical-cabaret-friday-/E0-001-096693965-8?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, NULL);
