INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(418, 'WinSETT Leadership Workshop Program Toronto', ' The Canadian Centre for Women in Science, Engineering, Trades and Technology (the WinSETT Centre) is bringing the entire suite of Women in SETT Leadership Workshops to Toronto for the first time. Complete all five workshops (10% savings) to truly develop your leadership potential or register for the specific skill you want to develop: Becoming Leaders (Oct 21, 2016) Effective Communication (Nov 25, 2016) Negotiating for Success (Dec 9, 2016) Navigating Politics at Work (Jan 20, 2017) Networking, Mentors and Sponsors (Feb 24, 2017) Registration for individual workshops 2, 3, 4, and 5 will open on Oct. 21.   Toronto Sponsors: Workshop Descriptions Becoming Leaders: An Introduction to Leadership Skills and Strategies Friday, October 21, 2016 What are the core competencies of leadership? What strengths and challenges do women in SETT face as they become leaders? At the end of the workshop, participants will be able to:  Identify gender factors in leadership for women in SETT Assess individual leadership competencies Describe strengths women bring and challenges they face as SETT Leaders Implement mechanisms to leverage those strengths and address those challenges Apply proven leadership tips and strategies for women in SETT Make career and leadership choices with enhanced confidence Recognize the importance of a peer network Effective Communication Friday, November 25, 2016 This workshop will enable participants to discover and tailor their own communication style and strengths to more effectively convey their ideas and solutions, exchange information and gain recognition. Identify gender factors in communication for women in SETT Classify four different styles of communication Assess personal communication style, strengths and challenges Differentiate communication styles in others Adapt personal style to communicate effectively with other styles Demonstrate strategic self-promotion and constructive feedback Recognize the importance of peer networking and feedback Negotiating for Success Friday, December 9, 2016 Participants will gain awareness of the many workplace situations in which negotiation takes place and learn about the underlying factors that can affect their personal effectiveness and outcomes for those negotiations. They will then practice methods to advance their own skills to negotiate for opportunities, resources, recognition, financial benefits, promotions and access to networks. Identify gender factors in negotiation for women in SETT Assess personal negotiation style, strengths and challenges Classify negotiation opportunities Distinguish five negotiation styles Deploy the ‘win-win’ (collaborative) negotiation style, including identifying, planning, conducting, documenting and learning from a negotiation Recognize the importance of peer networking and feedback Navigating Politics at Work Friday, January 20, 2017 This module will help participants recognize the informal organization of the workplace, understand the networks of influence and develop strategies to neutralize negative behaviours (yours and others’) and positively promote your ideas. Identify gender factors in workplace politics for women in SETT Compare the positive and negative roles workplace politics can play in a career Assess personal competencies in navigating workplace politics Recognize the informal organizational structures and relationships in their workplace Classify whether actions are political or personal Create a stakeholder priority map Build and leverage strategic relationships Determine their professional reputation Manage negative players Recognize the importance of peer network and feedback Networks, Mentors and Sponsors – What, Why, How Friday, February 24, 2017 The final module describes the importance of networks, their context, how to develop and strengthen your networking skills, elegant positioning for advancement and how to leverage your network in support of your career goals. The workshop will also describe the different kinds of mentors, coaches and sponsors and how to mutually benefit from those relationships. Identify gender factors in networks, mentors and sponsors for women in SETT Illustrate commonalities and differences between sponsors in mentors including the importance of each to leadership Assess individual networking, mentoring and sponsorship competencies Implement effective mentor and sponsor relationships Measure professional presence Demonstrate effective personal networking skills in common situations Recognize the importance of peer network and feedback Testimontials &quot;Very engaging, educational and empowering.&quot; &quot;The workshop was excellent. Without a doubt it is a &#39;must do&#39; for young women in the early phase of their career. In fact for all women, regardless of what phase they are at. Thank you.&quot; &quot;[The participants] found it to be a unique and affirming experience given that they have been in the minority for the bullk of their education and professional careers and haven&#39;t necessarily had the luxury of spending time talking with a female peer group. Many were surprised to discover how valuable it was to be in this stimulating and safe environment where women were free to talk about the challenges associated with their professions, and to hear from others as to how they are navigating this challenging and sometimes lonely landscape.&quot; FAQ: Is the workshop only for women in Science, Engineering, Trades and Technology? Yes.  Women who work in male-dominated SETT organizations but are not scientists, engineers, tradespeople, technicians or technologists are also welcome as many of the same challenges are faced. Will I receive Continuing Education Credits for the workshops? Yes, participants will receive a certificate equivalent to 7.5 hours of credentialed continuing education for each workshop. What is the refund policy?  The full fee can be refunded up to 5 business days before the beginning of the workshop, less a $100 administrative fee.  After the refund period has expired, no refunds will be issued, only substitutions will be accepted. Is there a minimum and maximum number of participants? Yes- we must have 10 participants to offer the workshop and no more than 30 will be accepted.  If a workshop is cancelled, you will be credited or refunded at your discretion) 100% of your fees paid. Is my registration transferrable? Your registration be transferred with prior agreement of the WinSETT Centre; contact us at winsett@hollettandsons.ca.  When and were are the workshops? Workshops will take place from 9:00AM - 4:00PM. The exact location (in downtown Toronto) will be announced shortly.   Will food be provided?  Yes - all workshops have hot and cold beverages, snacks and lunch included. What about parking? Parking information will be announced shortly. The location will be easily accessible by public transit.  Where can I contact the organizer with any questions? Please contact Susan Hollett (winsett@hollettandsons.ca), National WinSETT Leadership Program Coordinator for further information. ', 'http://toronto.eventful.com/events/winsett-leadership-worksh-/E0-001-096690535-0@2016111009?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 67);
