(438, 'VentureLAB- The B2B Sales Process November 3, 10 & 17, 2016', ' The B2B Sales Process  (3 sessions, 4 hours each) Entrepreneur&#39;s Toolkit Workshops are experiential, hands-on workshops facilitated by experienced entrepreneurs. The workshops offer ventures tools, mentoring and peer feedback to solve specific problems and develop essential business components.  In each four-hour session you will generate a deliverable that you will use frequently in the business development process. What will you get out of the B2B Sales Process workshop series?   Workshop Schedule  November 2, 2016 8:30am-1:00pm   Session 1 – The Sales Canvas Framework and the Sales Funnel   This session will introduce the Sales Canvas Framework, which encompasses all aspects of inbound and outbound sales activities, and how these activities relate to moving customer prospects through the sales funnel.    You will get the opportunity to explore the “Leaky Sales Funnel,” learn about cold calling techniques and practice managing individual sales opportunities to turn leads into prospects.   Deliverable: Techniques to book, prepare for and conduct a sales call   November 9, 2016 8:30am-1:00pm Session 2 – The Customer Sales Meeting This session will focus on how to move customers’ leads through the sales funnel. In preparation for your customer sales meeting, you will get the opportunity to identify various customer stakeholders, learn new negotiation tactics and practice managing individual sales opportunities to successfully turn customer prospects into sales. Deliverable: A Sales Process and Stakeholder Management Chart to prepare you to meet with your customers   November 16, 2016 8:30am-1:00pm Session 3 – Analyzing and Managing the Sales Process The final session will focus on the technical aspects of measuring the sales process to improve the quality and quantity of sales activities and make changes to become more efficient in closing sales.  You will define the stages of the sales cycle for your customers and map out your sales pipeline with some sales cycle probabilities. You will learn about how to define, track, analyze and manage your sales process. Deliverable: A spreadsheet approach to tracking sales with sales funnel data for a prospective customer    Doors for this workshop open at 8:30am and facilitation begins at 9am.    Cost of Workshops The Entrepreneur&#39;s Toolkit Workshops cost $100 to attend. There are two different ticket types that can be purchased: 1. ONE Client Refundable Deposit Purchase this ticket if you are a client of a regional innovation centre (Ontario Network of Entrepreneurs). When prompted on the registration page, please list the regional centre of which you are a member and your current advisor’s name. You will be refunded your full ticket price at the end of the workshop series and upon completion of our post-workshop survey..  2.  General Attendance Fee Purchase this ticket if you are not currently a member of a regional innovation centre. **If you are unable to attend a workshop session, please let us know four business days in advance. We regret that failure to do so may result in the loss of your deposit. **The post-workshop survey must be completed within four days of the last day of a workshop series for a registration deposit or discount to be refunded. If you would like more information on our workshop programs or how to become a client of a regional innovation centre, please contact workshops@marsdd.com.   Find out about new workshops by joining our mailing list.  ', 'http://toronto.eventful.com/events/venturelab-b2b-sales-proc-/E0-001-089062717-7@2016111008?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 67);
