(535, 'From Far & Wide - O Canada', ' This concert will feature works by Canadian composers and arrangers. From rollicking folksongs from the Maritimes to lush sacred works by iconic composers like Imant Raminsh and Healy Willan. We will present Songs for a Prospector by Stephen Chatman; My Hearts in the Highlands by David Millard; Stan Rogers&#39; &quot;Make and Break Harbour&quot; arranged by Ron Smail with special choreographed offerings from the Abbotsford Youth Orchestra; and a grand finale set of songs for orchestra and choir including works by Alistair MacGillivray and Bob Buckley. Our pride will be palpable during this show!<br> <br> 
