(540, 'Filly and the Flops + Cécile Doo-Kingué', ' <ul><li>21h30<li><li><a href="https://facebook.com/1737859026476717" rel="nofollow">Event Facebook</a></li></li></li></ul><ul><li><a href="http://facebook.com/pages/Filly-The-Flops/213581007463?fref=ts" rel="nofollow">facebook.com/pages/Filly-The-Flops/213581007463?fref=ts</a></li></ul><strong> FILLY & THE FLOPS</strong><br><p><p>Filly and the Flops is a five piece rockin’ rhythm and blues combo who know how to put the dipt in the diptydipty dip! Led by vocalist Felicity Hamer, the band boasts a jazzmatazz chorus of rhythm boys - Eddy Blake Eaton on the stand-up bass, Gabriel Lambert on the electric guitar, Kevin McNeilly on the acoustic guitar and Miles Dupire-Gagnon on drums.<p> Filly and the Flops est une formation énergique alliant le Rock&#39;n Roll et le rhythm & blues. Composé de Felicity Hamer à la voix, Eddy Blake Eaton à la contrebasse, Gabriel Lambert à la guitare électrique, Kevin McNeilly à la guitare acoustique et Miles Dupire-Gagnon à la batterie.<ul><li><a href="http://cdkmusik.com/" rel="nofollow">cdkmusik.com/</a><li><a href="http://soundcloud.com/cdkmusik/" rel="nofollow">soundcloud.com/cdkmusik/</a><li><a href="http://facebook.com/ceciledookinguemusik/" rel="nofollow">facebook.com/ceciledookinguemusik/</a></li></li></li></ul><strong>CÉCILE DOO-KINGUÉ</strong><br><p><p>Véritable bête de scène, la guitariste-auteur-compositrice-interprète lauréate Cécile Doo-Kingué allie blues, afro et soul pour créer sa griffe musicale unique. Par ses jeux de guitare ensorcelant, voix profonde et textes qui transpercent et transportent, Cécile vous prend par le coeur et les tripes, vous livrant une expérience musicale authentique et toujours mémorable.<p>Award-winning guitarist-singer-songwriter Cécile Doo-Kingu�� is quickly earning a stellar reputation and a place alongside Canada’s current roster of great guitarists.  Powerful and raw, with an exceptional stage presence, this NYC-born Montreal-based musician is a force of nature. The real deal. Cécile Doo-Kingué’s lyrics, and sound make for an enthralling and intimate evening that will leave a mark. She has released four albums to critical acclaim and received three 2015 Maple Blues Awards nominations.<p> </p></p></p></p></p></p></p>', 'http://montreal.eventful.com/events/filly-and-flops-ccile-dookingu-/E0-001-097032383-6?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, NULL);
