(574, 'Fall 2016 High River - Rhythm and Rhyme', ' Registration Begins August 29th, 2016 - 9:00 am register online or call 403 652-5090.  For parents/caregivers with children ages 0- up to 12 months.  Meet new people in a relaxed space while you learn new songs, rhymes and activities that fit the age of your child.  You will learn strategies to engage your child as they move through the different stages. There is no cost for these programs however, Literacy for Life greatly relies on donations from people like you. Thank you! Facilitators: Elone and Leanne Dates: (10 Sessions) Sept. 19, 26, Oct.3,17,24,31, Nov. 7,14,21,28 (No class Oct. 10) Day: Monday Time: 12:30am - 1:00pm         ', 'http://eventful.com/events/fall-2016-high-river-rhythm-and-rhy-/E0-001-096306605-8@2016111012?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 31);
