(577, 'Roots Homeschool - Disney''s Beauty & The Beast', ' Registered Roots Homeschool students and their families are invited to Disney’s Beauty & The Beast at Storybook Theatre. Join Belle and the Beast for one of the great musicals of the modern era. Adapted from the classic Disney animation, Beauty and the Beast has now been seen by over 35 million people worldwide since its premiere in 1994. Featuring all of the beloved songs from the original movie, including Be Our Guest and the title track, the show also includes additional numbers from original composer Alan Menken and musical theatre legend Tim Rice. An absolutely magical show, Beauty and the Beast is the perfect holiday musical for the whole family! RUNNING TIME: Two Act Musical - Approx. 120 minutes plus intermission  *Suitable for Ages 6 and up. Rated G. We apologize that we&#39;re not able to accommodate younger students or babes in arms. Registration deadline: Monday, September 26th (by 1 pm). START TIME - Please arrive 20 minutes early! We will not be able to enter the theatre until our whole group arrives, so please be on time. Our Roots group will meet inside the lobby of Storybook Theatre. FAQs I have a question, who do I contact? Please contact Tanis (field-trip organizer and Roots HS mom) Phone: 403-923-3490 or Email: thereuters@shaw.ca. My child is not registered with Roots, can they still attend? This theatre Fieldtrip is specifically for Roots students and their parents.   If you have other school aged children that are with a different HS board please contact the organizer of the field trip to be placed on a waitlist. Spots for the fieldtrip will be offered to registered students first and in the event that there is extra room you will be contacted. Can I view a script for content prior to my visit? Yes, please visit: http://www.storybooktheatre.org/2016-17-show-audition-information Do I have to bring my printed ticket to the event? No, you do not have to bring a ticket. We will have a master list with all the registration info. Individual theatre tickets will not be issued, we will be directed to our reserved seats by theatre staff. If I am unable to attend may I get a refund? We&#39;re sorry but we are unable to provide refunds. But, please feel free to find another Roots family to sell or pass along your tickets to. Other Important Details: Food, beverages, gum, cell phones, cameras and any recording devices are not allowed in the theatre. ', 'http://calgary.eventful.com/events/roots-homeschool-disneys-beauty-beast-/E0-001-096424655-4?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 31);
