(605, 'Great Lake Swimmers and Elliott Brood', ' <br><br>Date: <br><br>Thursday, December 1, 2016<br><br>Time: <br><br>7:00 PM (Doors Open), 8:00 PM (Show Starts)<br><br>Ticket Price: <br><br>$30 advance / $35 doors <br><br><p>The Aeolian presents Great Lake Swimmers and Elliott Brood<p><strong>Dec 1st show ELLIOTT BROOD is Headlining</strong><p><strong>Ticket sales open Monday, September 12!</strong><p><p>A Forest Of Arms is the sixth album from Tony Dekker&#39;s Great Lake Swimmers and the follow up to 2012&#39;s New Wild Everywhere. With a surging rhythm section, razor sharp violin, and flourishing banjo and guitars, Dekker and band mates have pushed their sound significantly, creating some of their most dynamic songs ever recorded.<p>Those familiar with the decade-long output of Great Lake Swimmers will recognize the thematic threads of beauty in the natural world, environmental issues and explorations of close personal ties that hold us together. The familiar versus the strange theme is also running through this record, both in the instrumentation and in the songwriting (&quot;Zero In The City&quot;, &quot;I Was A Wayward Pastel Bay&quot;).<p>As with past Great Lake Swimmers albums, A Forest Of Arms was recorded in several locations over the span of several months, covering extensive new territory while remaining true to the group&#39;s refined sound. One of the unique and unusual locations was Tyendinaga Cavern and Caves in Tyendinaga, Ontario, where a number of the vocal and acoustic guitar tracks, including the main parts for &quot;Don&#39;t Leave Me Hanging,&quot; &quot;The Great Bear&quot; and &quot;With Every Departure,&quot; were recorded amid haunting acoustics, stalactites, and circling bats.<p>Great Lake Swimmers consists of Tony Dekker on lead vocals and guitar, long time guitarist and banjo player Erik Arnesen, Miranda Mulholland on violin and backing vocals, Bret Higgins on upright bass and newcomer Joshua Van Tassel on drums. There are several special guest appearances on the album by Kevin Kane (Grapes Of Wrath) on 12-string electric guitar, as well as backing vocals on the song &quot;A Bird Flew Inside The House.&quot;<p><p> <p><p>For their fifth album, Elliott Brood wanted to break things. 2008&#39;s Mountain Meadows was shortlisted for the Polaris Prize, and the band&#39;s last record, Days Into Years, won a 2011 Juno award for roots album of the year. Now was the time to smash the precedents, break the mould. To withdraw to a farmhouse in Bath, Ontario, hammering out nine songs in two weeks.<p>For the first time, Elliott Brood decided to work with an outside producer: Ian Blurton, who has helped make roaring records for the Weakerthans, Skydiggers and Cursed. And for the first time, the group&#39;s two songwriters decided to mine the bare histories of their own lives: penning verses about the ends of relationships and the tests of adulthood, long drives, childhood retreating in a rear-view mirror. &quot;Work and Love will make a man out of you,&quot; the Constantines sang; and so here is Elliott Brood&#39;s Work and Love, their most personal album to date, the sound of a grown-up band searching their hearts for all they&#39;ve lost and gained.<p> <p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p>', 'http://eventful.com/events/great-lake-swimmers-and-elliott-brood-/E0-001-096381543-6?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 122);
