INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(608, 'Séan McCann', ' <strong><strong>Séan McCann <a href="http://markethall.org/wp-content/uploads/2015/02/seanmcannsmall.jpg" rel="nofollow"></a><br></strong></strong><br><strong><strong>Saturday November 26, 2016 – 8:00 PM</strong></strong><br><p>Séan McCann’s love for Newfoundland and Labrador folk songs shot him to international fame as a founding member of the renowned group Great Big Sea. After millions of albums sold, countless hit songs, and record breaking tours around the world, Séan realized that his 20 years with the band had to stop. Music is meant to connect, heal, and bring happiness. While Séan was giving that to thousands of people a night he was slowly losing his own way. Instead of seeking truth he was hiding behind his music. This was unfair to both himself and his fans so he left the band and started over.<p>In January 2014 Séan released his first post-GBS album. Produced by Joel Plaskett, “Help Your Self” is the sound of a man facing his demons and ultimately overcoming them. The songs helped him deal with his issues of addiction and abuse and showed him how to find strength in pain. It reminded him of the power of music which at one time would have been used to cast a Friday night spell over a sold out hockey arena on a Monday, but now finds him touring the country as a solo artist in intimate venues where he can sincerely connect with his audience in the way he always hoped to—face to face. Séan has also found himself using music as therapy, working with people who face physical, mental, and addiction challenges, and has become a sought after speaker trying to help others to help themselves find light through the darkness.<p>Séan’s journey to find his own peace, love, and happiness continues through his new music. “You Know I Love You” is a happy collection of songs sung by a man intent on sharing his joy directly with you. The world has changed. Today the only thing left between Séan’s music and those who wish to share it is a cellphone. Despite how small social media has made the world, and how it has included all of us into the same conversation with a simple hashtag #, the basic human quest for a connection to something real is too difficult to fit in just 140 characters. Luckily, through the years of technological advancement and subsequent social change, two universal energies remain constant— Music and Love.<p><strong>Presented by:</strong><p><strong><a href="http://markethall.org/wp-content/uploads/2013/08/CMHA-HKPR-logo-with-tagline.jpg" rel="nofollow"></a></strong><p><a href="http://markethall.org/wp-content/uploads/2013/08/mhlogo_branding.jpg" rel="nofollow"></a></p></p></p></p></p></p>', 'http://eventful.com/events/san-mccann-/E0-001-095039875-3?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
