(632, 'Solar Observing at Ontario Science Centre', ' <p>Safely observe the sun with specially filtered telescopes. Learn about our nearest star and try your eye at spotting exotic surface features, including sunspots, spicules and prominences. This program is offered by members of the Royal Astronomical Society of Canada.<p><strong>2016 Dates</strong><ul><li>September 10<li>October 1<li>November 5<li>December 3</li></li></li></li></ul><p><strong>Time:</strong> 10 a.m. to 12 p.m. <em>(</em><em>Weather permitting. In the event of cloud cover, program will be rescheduled to the following Saturday.)</em><p><strong>Price:</strong> Free<p><strong>Location:</strong> TELUSCAPE (outside main entrance)</p></p></p></p></p>', 'http://toronto.eventful.com/events/solar-observing-ontario-science-centre-/E0-001-090170305-4?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 122);
