(633, 'After School Art Classes at the Art Hub', ' <p>Would you like to grow your art and creative thinking skills in a tutor-style after school program? Our After School Art Studio Program is now being offered once a week on Tuesdays, Wednesdays, and Thursdays from 4:00 - 6:00pm!<p>Open to kids of all levels aged 5 - 16, your instructor will work with you to design projects according to your interests, level, or portfolio goals. Each student will get valuable one-on-one time with the instructor and assignments tailored to their interests, whether it is cartooning, realistic drawing, mixed media or even design.<p>All beginners are welcome! For greater flexibility, we offer 1 hour, 1.5 hour, and 2 hour sessions. All in-studio materials are included.<p>Register online or call us at 905-205-1231.<p><strong>Cost:</strong><p>8 classes: 1 hr: $150 / 1.5 hrs: $195 / 2 hrs: $255<br> Drop in pricing: 1 hr: $20 / 1.5 hrs: $28 / 2 hrs: $35 (HST extra)<p>Sibling discount: 10%.<p><a href="http://bit.ly/1XMwKJw" rel="nofollow">CLICK HERE</a> for more information.</p></p></p></p></p></p></p></p>', 'http://toronto.eventful.com/events/after-school-art-classes-art-hub-/E0-001-096387561-4?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 122);
