(698, '95th Winter Session', ' Winter Session is our premiere event. Every year since 1922, we have held a parliamentary session at the Manitoba Legislature in Downtown Winnipeg, a proud tradition that continues to this day.   Date: 26-31 December City: Winnipeg Location (debate): Manitoba Legislature, 450 Broadway Location (overnight): Kelvin High School, 155 Kingsway Age Range: 16-20 Cost: $120 ($110 before Nov. 10) Maximum Attendance: 100 ', 'http://eventful.com/winnipeg/events/95th-winter-session-/E0-001-096303804-6@2016122610?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 122);
