(701, 'Opera and Song with Martin Sadd, Tenor', ' An afternoon of story in song, with rising star tenor Martin Sadd.  Passonate, riveting and dramatic opera tales, beautiful intense melodies from the ballet, as well as lyrical folk tales - all will capture your imagination. ', 'http://eventful.com/abbotsford/events/opera-and-song-martin-sadd-tenor-/E0-001-096303754-2?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 122);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(702, 'NeuroLogic - Current and Emerging Technology in Neurosciences', ' The Neurosciences Education Committee is excited to present NeuroLogic 2016 - Current and Emerging Technology in Neurosciences on December 7th, 2016.     Our modern world is driven by technology; more and more, we find these innovations reflected not only in neuroscience research, but also in patient care, treatment modalities, and activities of daily living. At NeuroLogic 2016, we will be exploring how technology is being used to benefit patients in our city and around the world.     We&#39;re busy curating researchers and practitioners to demonstrate how new technologies may impact our patients, our clinical knowledge and our practice. We will post the speakers when confirmed, so keep your eyes on this feed and the event page for updates!       Confirmed Sessions:   Exploring the Role of Exoskeletons in Early Spinal Cord Injury Rehab  Learn More   ROSA the Robot with Dr. Walter Hader Learn More   The Sunshine Trial: Deep Brain Stimulation for Depression  Learn More   ACETS: Augmentative Communication and Educational Technology Service Learn More   Calgary&#39;s ESCAPE Trial: Randomized Assessment of Rapid Endovascular Treatment of Ischemic Stroke Learn More         FAQs   Who is the target audience for this event? The content will be aimed at nurses and allied health professionals, though any clinician, professional or caregiver who has interest in neurology, care and management of people experiencing neurological disease, or neurology research and news is welcome to attend.   Do I have to work in an area that cares for neuroscience patients to attend? No, anyone can register, though a basic knowledge of neurological function and dysfunction would be beneficial for you to get the most out of this event.  Are refreshments included in my registration? Yes, AM coffee and snacks are provided, as well as a delicious lunch provided by Sunterra Market.    What are my transport/parking options getting to the event? Parking is available in Lot 6, located across Hospital Drive from the Health Sciences Center, accessible via the +15.  If you do not already have on-site parking, visitor parking rates will apply. Parking information is available here. Calgary Transit options are also available.  Please click here to find your transit route to our location. What can I bring to the event? Coffee and water will be available, and we encourage everyone to BYOM (Bring Your Own Mug) and water-bottle to the event.  There are multiple water-bottle filling fountains in the Health Sciences Center and Atrium.     Where can I contact the organizer with any questions? Please send inquiries to julie.reader@albertahealthservices.ca   Is my registration/ticket transferrable? You may transfer your registration to another attendee if you are unable to attend.   Can I update my registration information? Yes, you can update your registration information under &quot;My Tickets&quot;.  Please ensure your name is spelled correctly and your email address is up to date.    Do I have to bring my printed ticket to the event? You will be signed in at the door with your name.  You do not need to print a ticket.   What is the refund policy? Refunds will be available until two weeks before the event.   ', 'http://calgary.eventful.com/events/neurologic-current-and-emerging-technology-neur-/E0-001-094212297-9?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 122);
