(734, 'Murder Mystery Dinner Theatre - Mafia Murders', ' Smoking Gun Entertainment Presents:  MAFIA MURDERS It&#39;s the roaring 20&#39;s and that means you have to know the password to get into this exclusive party at the Speak Easy.  The Godfather, his fashionista embarrasment of a brother, his bodygaurd, and Fifi the lounge singer will all be there.  Everyone has an agenda, and if you haven&#39;t made your bones yet, you could be called upon... so be prepared! OPTIONAL DRESS CODE:  1920&#39;s (Flappers, Gangsters, etc.) ', 'http://calgary.eventful.com/events/murder-mystery-dinner-theatre-mafia-murders-/E0-001-096274396-5?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 39);
