(738, 'North Island IGNITE 2016-2017', ' North Island IGNITE Athlete Development Program - Sept 2016 - June 2017 The IGNITE Athlete Development program is designed to provide future national team and Olympic or Paralympic athletes with fundamental athletic skills to support and enhance their athlete development in a manner consistent with their Long Term Athlete Development stage, in a world class, high performance and multi-sport environment. The IGNITE Athlete Development program will connect like-minded athletes in an environment where they are able to work together toward their goals.   The North Island Program runs ten months from September 2016 through June 2017. Payment for either phase Fall/Winter (Sept - Jan) or Winter/Spring (Feb - June) and includes 16 weeks of training, 3 times per week $380 per athletes.  Fees include pre and post program testing, 2 seminars, water bottle, gymnastics membership, log books and IGNITE jersey (for first time registrants only).   Full Program (Fall, Winter, Spring & Summer) $735 Fees include training across from September 2016 through June 2017.  Pre, mid and post program testing, minimum 4 seminars, gymnastics membership,  water bottle, log books and 2 IGNITE jerseys (for first time registrants only). Save $155 when you register for the Full Program.   ', 'http://eventful.com/events/north-island-ignite-20162017-/E0-001-095671419-3@2016111006?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 122);
