(739, 'Mini Makers - The Junior Guild', ' FOR MORE INFORMATION VISIT US AT  AGB.life       ART MATERIALS for children’s classes are included in the registration fee. WHAT TO WEAR? Clothing may get messy from the materials used in the class.  Closed-toe shoes are mandatory.  WHAT TO BRING? Snacks that are nut free.  We appreciate your cooperation! ALLERGY OR SPECIAL NEEDS? Important - Remember to notify us on your registration form if the student has an allergy, health concern or a learning disability that could impact participation in the class.  We want to ensure the best possible experience. CANCELLATION & REFUND POLICY Refunds are cheques payable to registrants, subject to the following: 1.     The AGB reserves the right to cancel or combine classes if minimum enrollment is not met. 2.    If a course is cancelled, registrants will be notified up to a week prior to class start. 3.     Requests for refunds must be made in writing to Studio Education Coordinator: Heather@AGB.Life 4.     No refunds will be given after the 2nd week of classes. 5.    Except for courses cancelled by the gallery, all refunds will be subject to a twenty-five dollar administration charge and a pro-rated deduction for classes up to AND including the date of the refund request. 6.    Refunds will be issued within six weeks of the cancellation.  7.   Save your receipt for tax purposes.   Have a Question? Contact Heather Borsellino Heather@AGB.LIfe or 905-632-7796 x307       ', 'http://eventful.com/events/mini-makers-junior-guild-/E0-001-095564009-5@2016111013?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
