(740, 'Awakening Book Club Toronto', ' 3rd Sunday of the month - September through May (excluding December) People coming together to experience words on a page...opening doors to learning about miracles, beingness, success, the power of the mind, spiritual chemistry, and much more.  Cheryl Millett will share the very books that have been discovered on journeys, passed down by generations, recommended by teachers...Tao Master, Tibetan Lama, and their students. Curious?! As students for life, we will explore together.  &quot;Every time I read a book again, I learn something else. Every time I read a book with a group, I broaden my imagination.&quot; shares Cheryl Every 3rd Sunday of the month from September 2016 through May 2017. 7:30 to 9:00 pm (excluding December) People can join anytime. Inspired by the Toronto Midtown Chapter Members (Holistic Chamber of Commerce). Non chapter members, family and friends are welcome. COSTS 2016/2017 Season Fee $20 Other costs are for the book purchases. Some bulk buying may be possible. Some audio, some articles will be included/free.  REGISTRATION Following registration, you will receive an email which will include the book list for the season. Plus you will receive the first reading which is an article titled &#39;Activating Miraculous Success&#39; (24 pages).  DATES Sep 18, Oct 16, Nov 20, Jan 15, Feb 19, Mar 19, Apr 16, May 21 *Book club rules apply and will be presented at the first gathering. About Organizer - Cheryl Millett Community and living well is her thing. Since 2011, metaphysical studies have been a daily part of Cheryl&#39;s life and practice hence starting up this book club. Full-time Cheryl practices Holistic Nutrition, Iridology and Omega 3 Education along with being a presenter. In 2015, she opened up a chapter of the Holistic Chamber of Commerce in Toronto. Community work is being the Founder of the Forest Hill Walk Club since 2008, and previously 16 years of volunteering for the Juvenile Diabetes Research Foundation - Corporate Stationary Bike-a-thon. ', 'http://toronto.eventful.com/events/awakening-book-club-toront-/E0-001-096133649-4@2016111019?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 60);
