(762, 'Being Present', 'Yoga & Meditation Workshop. Being Present is key to staying mindful in daily life. At the holiday season, being in the moment becomes especially challenging as we have so many things to do, places to be, and people to see. But ironically, being present is key to make the most of the time we have with our loved ones and staying calm despite the pressures we face. Throughout this workshop Kushok and Michelle will lead you in yoga and meditative practices to explore being present and learning how to maintain this awareness in daily life.', 'http://edmonton.eventful.com/events/being-present-/E0-001-097115313-7?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 29);
