(763, 'Rosie & The Riveters', ' <br> Rosie & the Riveters are four fiercely talented and sassy dames from Saskatoon, Saskatchewan, who perform uplifting folk music with a vintage 1940s flair! Their original songs feature sophisticated harmonies, body percussion, scintillating dance moves, humour and just enough ooh-la-la to charm your socks off! Along with whoops, hollers, and mile-wide smiles, they create a sound and sight that is lighthearted and captivating for all music lovers.They are inspired by Rosie the Riveter, the feminist icon who represents the womens movement into the workforce during WWII and embodies the strength and power that thrive in every woman. The Riveters are about empowering women to be ambassadors for change in their community and to attain this goal, they use 20% of their merchandise sales to support other womens projects around the world through KIVA.org.Since the bands formation in 2011, they have quickly taken the folk scene by storm! They have performed over 150 concerts across Canada and the United States, showcased at such events as Folk Alliance International, JunoFest, Folk Music Canada, been featured at numerous festivals and participated in workshops with artists such as Serena Ryder, Arlo Guthrie, The Bros. Landreth, and Kat Danser.Alexis Normand, Allyson Reigh, Melissa Nygren, and Farideh Olsen are the charming women who make up Rosie & the Riveters.', 'http://eventful.com/winnipeg/events/rosie-riveters-/E0-001-097115159-1?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 122);
