(781, 'PAST YOUR BEDTIME Presented by Andrew Phung and Renee Amber', ' What&#39;s in store for late night audiences? Surprise guests, new show formats, more juicy questions, and a hilarious night of improvised comedy! Grab a beer, take a seat, and laugh your week off with us. Featuring: Andrew Phung, Renee Amber, Ali Froggatt, Anyssa McKee, Sean Allen, Emma Ross, Alexa McKell, Michael Roik, Ellis Lalonde, Ayla Stephen, Covy Holland, and more. We do not recommend our evening shows for younger children, as we cannot guarantee the language or content will be appropriate. PLEASE NOTE: - Tickets are only sold online up until 6 PM the day prior to a performance, and any remaining tickets will be sold at the door. Please make sure you are purchasing online tickets for the correct date and time of the performance you wish to attend. - We offer assigned seating for all current performances. Seats are assigned in the order we receive the booking.<br> <br> 
