(784, 'SandyBone & The BreakDown', ' The End of the Line jam is best little jam on a Tuesday night in the whole darn city far as I&#39;m concerned! For 10 years and counting Double D and yours truly have been hosting this night and it is a second home for us and the many who come to indulge. The music is always first and always great and the rest just follows naturally. Folks arrive from all around the world and find there way to The Prinny and our stage, go figure...Check it out if you haven&#39;t already and if you have, well, you know of what I speak. See y&#39;all down the line!', 'http://vancouver.eventful.com/events/sandybone-breakdown-/E0-001-097088830-6@2016111520?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, NULL);
