(790, 'The Extremely Short New Play Festival 2016', ' This is the fourth edition of the award winning Extremenly Short New Play Festival. An evening of plays that are 10 minutes or less in length, all performed during each performance. The plays are all premieres, selected by a jury from over 150 submissions! This year we&#39;ve selected 11 new works. The cast of 6 actors play all of the characters and the set and costumes are designed to make the evening fast paced and extremely entertaining. The range of plays are not limited to any style or subject, like a box of chocolates, you never know what you&#39;ll be experiencing! We are pleased to be performing in the intimate Avalon Studio of the Acting Company, 738 A Bank Street, Ottawa. The festival runs for two weekends, November 25, 26, 27 and December 2, 3, 4. All shows start at 8 pm. General - CA$20.00', 'http://ottawa.eventful.com/events/extremely-short-new-play-f-/E0-001-097094195-1@2016112520?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 32);
