(809, 'TWU SAMC Theatre 16/17 Season Pass', ' SAMC Theatre makes your life easier with season passes! Loyalty deserves a reward, so we&#39;re giving you one. For one affordable price, you receive tickets to every show in our 2016-17 season: SMASH by Jeffrey Hatcher (Oct. 25-Nov. 5) disPLACE created by the ensemble (Nov. 22-Dec. 3) A KIND OF ALASKA by Harold Pinter (Jan. 31-Feb. 4) JANE EYRE: THE MUSICAL (Mar. 14-April 1) Perks for season pass holders: -Reserved seats - get the best view! -First dibs on Opening Night - the most popular night of the run -Worry-free - you&#39;re booked before shows are sold out -You&#39;re helping our theatre - upfront sales are good for the budget -You&#39;ll be famous! (thanked in the program) -Did we mention convenient & affordable? How to purchase: -STEP 1: Choose the Friday/Saturday Evening package, Weekday Evening package, or Saturday Matinee package. -STEP 2: After your purchase, you will choose your dates online. If needed, season pass holders may change dates later - subject to availability.<br> <br> 
