INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(860, 'Peter Asher Memoir', ' <a href="http://hughsroom.com/wordpress/wp-content/uploads/2016/10/13316b_7e13a72de77dcef57bf1f056e6058482.jpg" rel="nofollow"></a><p><a href="http://peterashermusic.com/" rel="nofollow"><strong>Peter Asher</strong></a>, CBE was born in London June 22, 1944, the son of a doctor and a professional musician.  He was educated at Westminster School in London and at Kings College, London University, where he studied philosophy.<p>Peter’s entry into the world of the performing arts was as a child actor.  At the age of eight he starred in his first film, “The Planter’s Wife” as the son of Claudette Colbert and Jack Hawkins.  He went on to act extensively in various film, TV, radio and stage productions.<p>His legendary music career began in 1964 as one-half of the singing duo Peter & Gordon, who amassed  nine Top 20 records during their career. Their debut single, “A World Without Love” –a song given to them by Paul McCartney – went to number one in over 30 countries, including the U.S. and U.K. In 1968, Mr. Asher became head of A&R for the Beatles newly formed record company, Apple Records, where he found, signed and produced James Taylor and worked closely with the Beatles on their individual projects.  During this period he became a key figure in the “revolution” of The Sixties, founding the book shop and art gallery “Indica” (where John and Yoko met and where Allen Ginsberg and William Boroughs visited) and found himself at the centre of an era of profound social and artistic change.<p>In 1971, Asher moved to the U.S. and founded Peter Asher Management, representing James Taylor and, beginning in 1973, the management and production of Linda Ronstadt as well.  Peter Asher Management became one of the most successful Artist Management companies in the US, handling artists such as Joni Mitchell, Randy Newman, and Carole King as well as James and Linda.<p>As a producer, Mr. Asher has worked with such diverse artists as James Taylor, 10,000 Maniacs, Diana Ross, Neil Diamond, Ringo Starr, Linda Ronstadt, Cher, Morrissey, Robin Williams, Jane Monheit, Kenny Loggins, The Dixie Chicks, Rodrigo y Gabriela, Hans Zimmer and Billy Joel, among many others.  He has been awarded 37 RIAA-certified gold albums and 22 platinum albums in the U.S., and many more internationally.  Mr. Asher has produced thirteen Grammy Award-winning recordings, and in 1977 and 1989 was honored individually with the Grammy Award for “Producer of the Year”.  He won a further Grammy in the category of “Comedy Album of the Year” for his production work with Robin Williams.<p>After a 37 year gap, Peter & Gordon reunited in New York for one benefit concert for a friend on August 2, 2005 which was very successful and they went on to perform together on various special occasions just for the fun of it until Gordon’s untimely death in July of 2009.<p>Since then Peter has continued to be in high demand as a record producer, consultant, lecturer and as a performer again in his successful one-man show, “A Musical Memoir of the 60s and Beyond”.   He has also received various international awards, is a member of Mensa and of SAG-AFTRA, a National Trustee of the Recording Academy and has been a frequent keynote speaker at industry events.<p>Other projects in recent years include “Carole King & James Taylor Live at the Troubadour”, an album from guitar duo Rodrigo y Gabriela (“Area 52”, recorded in Cuba) and the Buddy Holly tribute “Listen to Me” (an album and PBS TV Special<p>With Hans Zimmer, Peter produced music for “Pirates of the Caribbean 4”, “Sherlock Holmes 2”, “Madagascar 3”, “Man of Steel” and “Rush”.In fact, Peter sang and produced the only original song in “Madagascar 3”, the love theme “Love Always Comes as a Surprise” which Peter co-wrote with his friend Dave Stewart. He also collaborated with Zimmer and Pharrell Williams on the production of all the musical elements of the Academy Awards show 2012.<p>At the request of Elton John, Peter-alongside Elton-invited contemporary artists to sing the songs from “Yellow Brick Road” on the occasion of the 40th anniversary of that album.  Peter produced the recordings, and list of artists includes Ed Sheeran, Miguel, The Band Perry, John Grant, Fall Out Boy, and Hunter Hayes. The album was released in March 2014 as part of a deluxe edition of “Goodbye Yellow Brick Road.”<p>Current projects include the production of “So Familiar”, the second release by the team of Steve Martin and Edie Brickell. “So Familiar” is the follow-up album to the highly successful (and Grammy-winning) “Love Has Come for You” (Steve Martin & Edie Brickell) which has also generated a PBS special and a stage musical, “Bright Star”, of which Peter is the music supervisor.  “Bright Star”, directed by Walter Bobbie, just finished a run on Broadway that garnered 5 Tony Award nominations.<p>Peter is the Director of the highly acclaimed Hans Zimmer live concerts<p>“Hans Zimmer Revealed”, and “Hans Zimmer Live On Tour”. Dates ran from April until June 5, 2016 in the U.K. and Europe.<p>He produced the songs for the Barry Levinson movie, “Rock the Kasbah” (Bill Murray, Bruce Willis and Zoe Deschanel.)<p>In the New Year’s Honours list for 2015, Peter Asher was awarded a CBE (“Commander of the Most Excellent Order of the British Empire”) by Her Majesty Queen Elizabeth.  The official investiture took place at Buckingham Palace on February the 24th, conducted by Prince William, Duke of Cambridge.<p>Photo credit to Michael Weintrob</p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p>', 'http://toronto.eventful.com/events/peter-asher-memoir-/E0-001-097037378-9?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, NULL);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(861, 'Kevin Fox', ' <a href="http://hughsroom.com/wordpress/wp-content/uploads/2016/09/kevin-fox-3.jpg" rel="nofollow"></a><p>If you have come in contact with Canadian music at all over the last number of years, chances are you have either seen or heard the work of multi-instrumentalist, singer/songwriter and composer/arranger  <a href="http://www.kevinfox.ca/" rel="nofollow"><strong>Kevin Fox</strong></a>.<p>Kevin has worked in the studio and on stage with a variety of artists, from Celine Dion to Katharine McPhee to Olivia Newton John. He has spent much of the last seven years touring extensively with award-winning Canadian artists Chantal Kreviazuk and Steven Page. As a composer/arranger, Kevin has composed music for film and television as well as arrangements for artists ranging from Tom Cochrane to Jully Black to Justin Bieber.<p>Kevin is also a singer/songwriter in his own right, with a continually increasing fanbase that began with the release of his first album COME ALIVE and has continued to grow along with the critically acclaimed SONGS FOR CELLO & VOICE and most recently with his 2011 release, SET RIGHT.<p> <p> </p></p></p></p></p>', 'http://toronto.eventful.com/events/kevin-fox-/E0-001-096543660-4?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, NULL);
