INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(864, 'The Small Glories – Cara Luft & JD Edwards', ' <a href="http://hughsroom.com/wordpress/wp-content/uploads/2016/10/the-small-glories-58-of-176-edit-1.jpeg" rel="nofollow"></a><p>Folk powerhouse pair <a href="http://www.thesmallglories.com/home" rel="nofollow"><b>The Small Glories</b></a> are <b>Cara Luft & JD Edwards</b>, a dynamic new duo planted on the Canadian Prairies. They are a study in contrasts; Cara, all earth mother on her 21-speed bike, helmet and backpack, environmentally friendly and wholesome, ebullient and engaging; and burly JD, looking like a cross between a biker and long-haul trucker in scruffy beard, ball cap, t-shirt and jean jacket, slightly intimidating (until you meet him). At first glance few would peg them for a highly creative musical partnership. Yet these two veteran singer/songwriters have teamed up and are building a buzz around their tight harmonies, authenticity and visceral performances. Luft is a <strong>Juno award winner</strong>, co-founder of folk trio <b>The Wailin’ Jennys</b>, and a touring road warrior. She has earned a solid reputation as an exciting live performer, accomplished guitarist, clawhammer banjo player and insightfully honest songwriter. Edwards has a voice that defies categorization, one that easily ranges from gentle and melodic to fierce and powerful, leaving listeners begging for more. He is truly one of the finest singers of his time. Together as <b>The Small Glories</b>, Luft and Edwards are a tour de force, a case of 1 + 1 = 3.<p> <p>Photo by Mike Latschislaw<p> <br></p></p></p></p>', 'http://toronto.eventful.com/events/small-glories-cara-luft-jd-edwards-/E0-001-097037381-3?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, NULL);
