(875, 'IRL', ' LIMITED GROUPON/ONLINE VOUCHER AVAILABILITY - PLEASE CONTACT BOXOFFICE@COMEDYBAR.CA FOR MORE DETAILS.<br><br> Where do old social media posts go? <br> Can they find their way home back to the open arms of a love that&#39;s waiting there? <br><br> Damnnn, IRL, the social media themed storytelling & standup comedy show back at it again, like Daniel. The place where comedians showcase their funniest & favourite Facebook posts, Tweets, Instagrams, comments, msgs, texts etc etc! Hosted by social media addict/nostalgia fiend, Jhanelle Dennis. <br><br> Tix are $10 (available at comedybar.ca or the box office). <br> You do not wanna miss this one! Hope to see ya get your @$$e$ off the internet & in real life :)', 'http://toronto.eventful.com/events/irl-/E0-001-097032729-4?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 28);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(876, 'London Community Orchestra - Young Soloists Concert', ' <ul><li></li></ul><br><p><strong>Camille Saint-Saëns</strong><br> Violin Concerto no. 3 in b, Op. 61<br>   -Joshua Lee, violin<br><br><strong>Nikolai Rimsky-Korsakov</strong><br> Piano Concerto in c-sharp, Op. 30<br>   -Matthew Zhou, piano<br><br><strong>Alexander Arutiunian</strong><br> Concerto for Trumpet and Orchestra<br>   -Patrick Smithers, trumpet<br><br> Our featured young soloists concert is always a big hit each year!  The concert will feature three incredibly talented young musicians who will be performing for their first time with an orchestra.  In May, our soloists were chosen by auditioning with their respective concertos, and they showed amazing talent that we can&#39;t wait to share with you!<br><br><em>Sponsoring our young soloists concert is Greta Toni Swart</em><br><br><strong>Single ticket prices:</strong><ul><li>Adults: $18.00<li>Seniors: $15.00<li>Students: $12.00<li>Children: 12 and under: $5.00</li></li></li></li></ul><p><strong>Single tickets are available:</strong><ul><li>Orchestra members<li>At the door<li>Online tickets available: <a href="http://www.onstagedirect.com/lco" rel="nofollow">www.onstagedirect.com/lco</a></li></li></li></ul><br><a href="http://www.londontourism.ca/Events/Music/London-Community-Orchestra--Young-Soloists-Concert#" rel="nofollow"></a></p></p>', 'http://eventful.com/events/london-community-orchestra-young-soloists-concert-/E0-001-097032211-0?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, NULL);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(877, 'London Community Orchestra - Mary Elizabeth Brown', ' <ul><li></li></ul><br><p><strong>Peter Ilych Tchaikovsky</strong><br> Violin Concerto in D, Op. 35<br>   -Mary Elizabeth Brown, violin<p><strong>Peter Ilych Tchaikovsky</strong><br> Orchestral Suite no. 1 in d, Op. 43<p>We&#39;re featuring an all-Tchaikovsky concert! Violinist, Mary-Elizabeth Brown will return to the stage playing Tchaikovsky&#39;s violin concerto in D.  You may remember Ms. Brown&#39;s incredible performance of Beethoven&#39;s violin concerto with us in 2014.  Ms. Brown is recognized on the international stage for her virtuosity and command of the violin.  She is founder and Director of Strings Around the World and music director for lake Field Music. <br><br> Tchaikovsky&#39;s Orchestral Suite no. 1 is written in 6 movements - 4 of which the orchestra will perform (movements 1, 2, 3 & 6).  The Suite was a way for Tchaikovsky to break from writing symphonies, most notably the 4th symphony written around the same time.  Although this Suite could simply be excerpts of a symphony, it has historically been seen as its own independent work.  The piece presents a wide range of styles and moods, and it was difficult for Tchaikovsky to to make it add up to coherent experience, eventually delaying its completion by one year.<br><br><strong>Single ticket prices:</strong><ul><li>Adults: $18.00<li>Seniors: $15.00<li>Students: $12.00<li>Children: 12 and under: $5.00</li></li></li></li></ul><p><br><strong>Single tickets are available:</strong><ul><li>Orchestra members<li>At the door<li>Online tickets available: <a href="http://www.onstagedirect.com/lco" rel="nofollow">www.onstagedirect.com/lco</a></li></li></li></ul><br><a href="http://www.londontourism.ca/Events/Downtown-London-Events/London-Community-Orchestra--Mary-Elizabeth-Brown#" rel="nofollow"></a></p></p></p></p>', 'http://eventful.com/events/london-community-orchestra-mary-elizabeth-brown-/E0-001-097032173-1?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, NULL);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(878, 'London Community Orchestra - Christine Newland', ' <ul><li></li></ul><br><p><strong>Camille Saint-Saëns</strong><br> Cello Concerto no. 1 in a, Op. 33<br>   -Christine Newland, cello<p><strong>Antonin Dvorak</strong><br> Silent Woods, B. 182<br>   -Christine Newland, cello<p><strong>César Franck</strong><br> Symphony in d<p>For over 40 years, Christine Newland held the principle cellist chair for Orchestra London, and continues to do so with WePlayOn.  Christine is a Canada Council supported artist, and has performed as solo for CBC and BBC radio & television.  Her extensive career in music has taken her all over the world, touring in Germay, Europe, Japan and Canada.  Christine will join the orchestra playing two selections - Saint-Saëns cello concerto No. 1 & Dvorak&#39;s Silent Woods. <br><br> The LCO rounds off their season in a facinating performance of César Frank&#39;s only Symphony.  The Belgian composer completed the symphony in 1888, taking two years to finalize.  The symphony was one of the last compositions in his career, performed only a year before his eventual death.<br><br><em><em>Sponsoring this concert is Brian Cunliffe, Cunliffe Hicks Wealth Management, RBC Dominion Securities</em></em><p><strong>Single ticket prices:</strong><ul><li>Adults: $18.00<li>Seniors: $15.00<li>Students: $12.00<li>Children: 12 and under: $5.00</li></li></li></li></ul><p><br><strong>Single tickets are available:</strong><ul><li>Orchestra members<li>At the door<li>Online tickets available: <a href="http://www.onstagedirect.com/lco" rel="nofollow">www.onstagedirect.com/lco</a></li></li></li></ul><br><a href="http://www.londontourism.ca/Events/Downtown-London-Events/London-Community-Orchestra--Christine-Newland#" rel="nofollow"></a></p></p></p></p></p></p>', 'http://eventful.com/events/london-community-orchestra-christine-newland-/E0-001-097032169-8?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, NULL);
