(884, 'ITSAZOO presents Hidden', 'ITSAZOO presents the bone-chilling site-specific horror event Hidden, October 22 – November 13, 2016 at UBC Botanical Garden. Blurring the lines between performance and reality, ITSAZOO will guide audiences of 13 people, armed only with flashlights, on the Lost Lovers Murder Tour – a frighteningly accurate re-enactment of the infamous and unsolved murders that occurred exactly 20-years ago, deep within the forest. Inspired by classic horror movies, Playwright and Co-Director Sebastien Archibald and award-winning Director Chelsea Haberlin will take audiences on an experiential journey – part historical murder tour, part outdoor adventure, and part meta-theatrical thriller.
