(888, 'DIANA + Mozart''s Sister + more', ' Presented by: Spectrasonic, punkottawa.com, House of TARG, Beau&#39;s All Natural<br>Doors: 9pm / Show at 10pm<br>Cover:  $12 advance + service charges<br><br><strong>DIANA</strong> (Toronto Synth Pop)<br>DIANA comparisons defy eras; from Roxy Music to Toro Y Moi, from Style Council to Nite Jewel, from Sade to Twin Sister. This makes sense; though they&#39;re happy to be in this good company, for DIANA the point is pushing forward, and that they do.', 'http://ottawa.eventful.com/events/diana-mozarts-sister-more-/E0-001-097007458-7?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, NULL);
