(936, 'FA16CHBI Children''s Book Illustration with Kevin Fraser', ' With Kevin S. Fraser In this course students will explore the magical world of children’s book Illustration. They will learn how to research, design, and write a children’s book while having a blast doing it. They will create their own characters, backgrounds and props through careful instruction. They will learn the elements of what makes a good story and learn resourceful ways of presentation through instruction. Children’s literature is a great way to use your imagination and also teaches discipline, organization and letting loose the creativity that we all have inside. So if you enjoy drawing and creative writing and everything you can imagine is real-this is the course for you. ', 'http://toronto.eventful.com/events/fa16chbi-childrens-book-i-/E0-001-096097344-7@2016111021?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
