(957, 'All About Boards 2016', ' <ul><li></li></ul><br><p>Energize your board and take your organization to the next level. This series will give you the fundamentals for a high-performing board focused on strategy, innovation, diversity and accountability.<p>Daily Schedule 20-Sep-2016 - 9:00 am to 12:00 pm 19-Oct-2016 - 9:00 am to 12:00 pm 15-Nov-2016 - 9:00 am to 12:00 pm 06-Dec-2016 - 9:00 am to 12:00 pm<p>Is your board fully engaged at and between meetings? Are you looking to strengthen your board’s effectiveness? Does your board have clearly defined roles and responsibilities? Does your board have a vision for the future? Learn what every director needs to know: -Characteristics of high-performing boards and how you can enhance the performance of your own board -Key financial accountabilities and responsibilities associated with the role of a director -How to attract, recruit and retain the best boards -Recognize strategic opportunities and risks -Identify best practices in governance in the nonprofit sector.<p>Participants will receive: An opportunity to build a professional network of board contacts, a professional development opportunity that can help build your resume, a certificate of participation for completing all 4 sessions.<p>Cost: Pillar Member Series: $210.00 Non-Member Series: $270.00 Member Group Discount (3 or more registrants): $190 per person Non-Member Group Discount (3 or more registrants): $240 per person Special Member Organization Rate: $105 (Applicable to member organizations who pay $60 membership fee)<br><br>  <p> <br><a href="http://www.londontourism.ca/Events/Downtown-London-Events/All-About-Boards-2016#" rel="nofollow"></a></p></p></p></p></p></p>', 'http://eventful.com/events/all-boards-2016-/E0-001-095834191-9?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 31);
