(969, 'Tim Gray', ' <br> Tim Gray has been performing comedy in Winnipeg since 2007. He holds a bachelors degree in Dramatic Arts from the University of Manitoba. It was at that school that Tim founded the U of M Comedy Club, started producing shows for his improv group, and started a weekly sketch show on UMFM with Dan Huen called The Gray Area of Comedy. In 2011 he co-wrote and co-directed a sketch show for the Winnipeg Fringe called Full Screen Ahead with Stephen Sim (CRUMBS). Uptown Magazine gave the show 4.5/5 stars. In the same year, the television show The Week Thus Far launched on ShawTV. He currently holds five titles on that weekly satirical news/talk show including Writer and Segment Coordinator. Tim has been passionately pursuing stand-up comedy for over three years now and could not be more excited to be a part of the Winnipeg Comedy Festival.', 'http://eventful.com/winnipeg/events/tim-gray-/E0-001-096985742-5?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 122);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(970, 'Bill Frisell', ' <br> Long a master of creating space, Bill Frisell has built a career by manipulating the sound of his guitar to create unexpected sonic landscapes. According to The New Yorker: Bill Frisell plays the guitar like Miles Davis played the trumpet: in the hands of such radical thinkers, their instruments simply become different animals.&quot; Free from the confines of a group, Frisells singular artistry as an improviser, composer and radical musical re-interpreter becomes crystal clear. For this performance, Frisells choice of material may roam freely from his own original compositions, to his inimitable take on all forms of American vernacular music. This night should be a required listening for all guitar players and lovers of music. &quot;Its hard to find a more fruitful meditation on American music than in the compositions of guitarist Bill Frisell. Mixing rock and country with jazz and blues, hes found what connects them: improvisation and a sense of play. Unlike other putschists, who tend to duck passion, Mr. Frisell plays up the pleasure in music and also takes on another often-avoided subject, tenderness.&quot; The New York Times&quot;Frisell is without a doubt, the single most important guitarist in jazz, a genius who is going to have the kind of influence on his instrument Jimi Hendrix and Wes Montgomery had before him &quot; Seattle Times', 'http://vancouver.eventful.com/events/bill-frisell-/E0-001-096985223-5?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 122);
INSERT INTO evenement
