(974, 'After-School Program: Obstacle Course & Robot Build', ' The Obstacle Course and Robot Build works to foster a strong sense of collaborative problem solving skills through a large-scale obstacle course team build. Participants will work together to design and build an obstacle course and independently work to create robots that they will then use to navigate the “opposing” team’s obstacle course. Participants will develop knowledge of basic robotics, design, and structural engineering, while having ample opportunity to learn how to use the laser cutter as well as various power & hand tools. Suitable for Young Makers age 8+ Date: Thursday, October 6th - November 24th  Time: 4 p.m.- 6 p.m. Cost: $275 Where: East-end location (1803 Danforth Ave.) ', 'http://toronto.eventful.com/events/afterschool-program-obsta-/E0-001-095555333-7@2016111016?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 31);
