(979, 'Tribute Concert: Dave Brubeck', ' Montreal’s Remi Bolduc Jazz Ensemble is currently touring with A Tribute to Dave Brubeck, one of America’s most iconic jazz composer-pianists. Bolduc’s music catches the ear whether it’s a modern twirl of dissonant jazz, an improvised spiral or the catchy rhythms of one of the greats. Accompanying him is guest pianist Francois Bourassa, as well as his standard rhythm section, bassist Fraser Hollins and drummer Dave Laing. General $35 Student/Alumni $25 General 4 Pack $100', 'http://eventful.com/events/tribute-concert-dave-brubeck-/E0-001-042208610-6?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, NULL);
