(983, 'International Guitar Night', ' International Guitar Night (IGN)—The world’s foremost acoustic guitarists are brought together by IGN founder Brian Gore to perform their latest original compositions and exchange musical ideas in a public concert setting. For 17 years, International Guitar Night’s Brian Gore has invited a new cast of guitar luminaries from around the world to join him for special concert tours highlighting the diversity of acoustic guitar. International Guitar Night remains as one of the premiere performances that we present year after year. World class talent manifests itself on the stage in completely different genres with every concert event and never fails to thoroughly engage and entertain our audience. For International Guitar Night’s 17th year of touring, Brian Gore has chosen three new, incredibly dynamic musician; Italy’s innovative contemporary guitarist Luca Stricagnoli; brilliant young Brazilian composer/performer Chrystian Dozza, and India’s groundbreaking slideguitarist Debashish Bhattacharya. For information on IGN and these artists visit www.internationalguitarnight.com Pricing: General $35 Student/Alumni $25 General 4 Pack $100', 'http://eventful.com/events/international-guitar-night-/E0-001-041991579-2?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 63);
