(987, 'A Royal Champagne Afternoon Tea at the Fairmont Empress', ' Royal pinkies up! To honour and celebrate the Duke and Duchess of Cambridge&#39;s upcoming visit to Canada, select Fairmont hotels will be launching A Royal Champagne Afternoon Tea. Featuring the creations of former Royal Pastry Chef Darren McGrady, the new tea menu will include such beloved items as: caramel banana cake (Prince William and Harry&#39;s childhood favourite), coronation chicken mayonnaise bridge rolls (Queen Elizabeth II&#39;s sandwich of choice) and the Royal Chocolate Birthday Cake (a family recipe passed down from Royal chef to Royal chef dating back to Queen Victoria). A Royal Champagne Afternoon Tea will be offered at Fairmont Empress Lobby Lounge from September 30th until November 30th. <p> Chef Darren McGrady will be on hand to launch A Royal Champagne Afternoon Tea at Fairmont Empress on September 30th. A sneak peak of the menu will be offered to a select group of media on September 29th at 3:00pm. </p>', 'http://eventful.com/events/royal-champagne-afternoon-tea-fairmont-empress-/E0-001-043110160-1?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 62);
