(988, 'Starman: Acoustic Bowie', ' <p> When Doug Cox first conceptualized Starman:An Acoustic Evening of David Bowie Songs, the thought of it being a posthumous tribute to the influential English rock star was inconceivable. Starman will be presented as a songwriters-in-the-round format, with lead vocals split evenly among band members. Cox has recruited a solid cast of professional musicians, including Juno award-winning singer/songwriter Helen Austin, and Shaun Verreault of Wide Mouth Mason. Other band members include Cox’s long-time collaborator Sam Hurrie, Linda McRae (Spirit of the West), percussionist Robin Layne (Locarno) and Canadian bassist extraordinaire Rick May. Members of the all-star band chose Bowie songs that were meaningful to them, and the results cover his entire career — up to and including a song from his last album, Blackstar, which was released January 2016. Join an inspired, diverse group of Canadian singers/musicians as they celebrate the songs of Bowie in this in-the-round concert performance. <p> General admission: $35 Student/Senior/Alumni: $25 General 4-Pack: $100 </p></p>', 'http://eventful.com/events/starman-acoustic-bowie-/E0-001-096970918-2?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 63);
