(991, 'March-Calgary- Agatsu Lower Body Mobility & Movement Level 1', ' MOVEMENT IS MEDICINE-Do you want to learn how to train pain free?-Need to increase your flexibility?-Do you want to learn step by step progressions that will take your bodyweight training to another level? Joint Mobility & Body Weight training have been a part of the Agatsu system since its inception. Through years of study of various health and martial arts systems, yoga, dance and gymnastics, Shawn Mozen has partnered with Sara-Clare Lajeunesse to create an active and effective joint mobility program that has become the corner stone to all of their training. With the simple idea that we must first learn to master our own bodies before we can learn to overcome the resistance offered by weights, the Agatsu Joint Mobility & Movement program was born. LOWER BODY- Level 1, you will learn: Progressions to developing a rock bottom squat, below 90 degrees. Squatting deep isn’t out of reach if you know what’s stopping you from getting there. Learn how to safely and effectively take the Squat apart and built it from the ground up for any client. Why you should be complementing your Squat training with Dead Lifts and how to safely perform many excellent variations of this great exercise. Why single leg strength training is a must. Explore lunges, Hawaiian Squat, Pistols, Split Squats, Cossack and other single leg variations and how they correct muscle imbalances and help you gain greater control and strength in sports and weight training. How, why, when and where should you use Joint Mobility in your training? Explore the fundamentals of joint mobility and joint preparation training and the essential roles they play in warm-up and injury prevention. Bullet proof your lower body. Stop hurting yourself in training and start building a stronger more resilient body. Learn how to safely and incrementally train in positions of disadvantage to gain greater stability within your joints. Work on specific exercises and flow drills to aid the lower back, hips, knees and ankles to gain greater range of motion and help relieve joint pain. Train without pain! Learn how to deal with and help remove stalls in joint ranges of motion through the use of self -massage, fascial stretch and Adaptive Bodywork techniques. Build on progressions to basic rolling, falling and balance exercises without the use of your upper body. Develop your flexibility and greater range of motion through dynamic and loaded stretching progressions for the lower body and lumbar spine. Understand and create a sound pre-workout joint mobility and joint preparation warm up, as well as develop a post training stretching and self-massage practice. To help you take notes and organize the large amount of material we suggest that you purchase a copy of the e-book located in our store. Early Bird Price - CA$500.00 Regular Price - CA$650.00 Mobility & Movement Online Library - CA$99.99', 'http://calgary.eventful.com/events/marchcalgary-agatsu-lower-body-mobility-movemen-/E0-001-095426066-1?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 54);
