(996, 'FDS Young Innovators Weekend Program North Toronto (MIDDLE SCHOOL)', ' The Young Innovators Program Helps Youth Build Big Ideas! The FDS Young Innovators Program empowers kids to create, innovate and develop their entrepreneurial skills. We help kids uncover their passion, build prototypes and pitch solutions that bring meaningful change to the world. Students learn design methods and get hands-on experience building new business offerings. Developed with world-class entrepreneurs and educators, the FDS experience is unique, transformative and an amazing way to develop leadership and critical thinking skills. Students are mentored throughout the process, and are exposed to thought leaders through our global network of entrepreneurs. Throughout the program they develop stronger confidence in themselves as creative entrepreneurs.   This is a video of some of our alumni talking about the experience. See what previous attendees have designed:Young Innovator Stories Areas of Exploration Real World Challenges and Opportunities Design Thinking Strategy Customer Discovery Rapid Prototyping User Testing and Iterating on Feedback Business Model Generation Presentation Skills Our Young Innovators Program in North Toronto runs for 11 weeks for 2 hours per session.  This program is open to students in Grades 5-8. Family and friends are invited to attend Demo Day on the final session date to watch their children in action pitching their designs.  Throughout the program participants get hands-on experience with leading design methods taught by a team of passionate educators and are inspired by startup founders from the community.   Please contact us with any questions you may have by emailing team@futuredesignschool.com or calling us toll-free at 1-800-975-5631. ', 'http://toronto.eventful.com/events/fds-young-innovators-week-/E0-001-096368752-3@2016111016?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 122);
