(1011, 'Jerry Granelli', ' <br> Revel in the pure, unadulterated meaning of Christmas with the live original score of A Charlie Brown Christmas, performed by renowned drummer Jerry Granelli - the only surviving member of the Vince Guaraldi Trio - who wrote and performed A Charlie Brown Christmas&#39; memorable soundtrack. Simon Fisk and Chris Gestrin round out Granellis trio. A childrens choir will perform their parts of this seasonal special.', 'http://calgary.eventful.com/events/jerry-granelli-/E0-001-097115047-7?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 59);
