(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1030, 'The Big Lie', ' While sitting around a table this spring, having an intimate group conversation, several of us began sharing our Big Lies....those untruths that we use as an excuse to stay stuck, remain indecisive and keep others comfortable, at the expense of our own individual happiness and potential. The outcome of this conversation was that many of us took the question &quot;What is your Big Lie&quot; with us to dinner parties, networking events, coffee dates and family dinners. The stories that came forth, the truths that were discovered and the connections that were made were astounding and remarkable. We were so excited by the conversations, ideas and movement forward that we witnessed that the logical next step was to offer this conversation, AND a solution to a larger audience of Women and Men.   So.... What is your Big Lie?   * The Big Lie is a story you have adopted as the truth, so you act it out on a daily basis and keep hitting replay. * Playing out your Big Lie keeps you small, stuck and on repeat instead of moving forward into your truth. * Your Big Lie can negativley infiltrate your relationships, career and even your passions or true path.   Often, on the other side of your Biggest Lie, lives your greatest gift and calling. Find out how you can conquer your Big Lie and Live out a New Truth.   If you are ready to: -Improve your Relationships at home and at work - Step into Your Truth -Immediately Move Forward in a Meaningful Way   Join us. Saturday, November 26, 2016 10 am-3 pm Cardel Theatre, Calgary Alberta   In this full-day interactive workshop, you&#39;ll; -Spend the day in a Safe Environment with Amazing Women and Men -Get Clear on the Story or the Lie that you may not realize keeps you on repeat, and getting the results you&#39;ve always gotten. -Participate in practical exercises -Make meaningful connections with others -Leave with tangible take-aways, including;  -A 3-5 part action plan to help you take the most important steps in redrafting a new reality  ( we&#39;ll all participate in taking your first step, in the workshop setting!)   Your Investment of $155 includes; -all materials -instruction and facilitation -lunch **Register before October 15 and pay only $135 Your Faciliators: Shandra Carlson   Shandra is a certified coach, facilitator and speaker dedicated to the work of redefining identity and purpose for athletes, veterans, retirees or anyone faced with life altering transitions. As an award winning leader and motivator, her portfolio life also includes writing and finding hidden messages in everyday life.Drowning in mediocrity and boredom is not Shandra&#39;s idea of fulfilment. Her ability to communicate enthusiasm, even in adverse circumstances, draws others to consider new ideas and personal growth as part of their own pursuit of a life well-lived.Shandra&#39;s innate ability to connect at a deep level, while putting others at ease in their own process, fulfills the sense of purpose that drives her to help others discover theirs.   Lana Wright   Lana is the founder of Womentum, a community for women which allows them to show up authentically to be seen, heard, understood and celebrated. Lana is also a writer, speaker, podcaster, collaborator,  forward movement cheerleader and professional &quot;but&quot;-kicker.  She has a gift of creating safe, inclusive environments for people to connect and speak their truth freely, while being fully accepted.  It is her wish that all people are reminded of their potential, personal power and ability to create and maintain meaningful relationships, while honouring their personal boundaries and relationship with self.    Cancellation Policy: After September 1st no refunds will be given. Prior to that an administration fee of $15 will be charged for cancellations. Please ensure you are available for the whole workshop. If you are unable to join us after you have formally registered, your spot is fully transferrable to another person.   Payment: If you require a payment plan, please email Lana at lana@wearewomentum.com     ', 'http://calgary.eventful.com/events/big-lie-/E0-001-095878793-5?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 54);
