VALUES
(1111, 'Kevin Fox', ' <a href="http://hughsroom.com/wordpress/wp-content/uploads/2016/09/kevin-fox-3.jpg" rel="nofollow"></a><p>If you have come in contact with Canadian music at all over the last number of years, chances are you have either seen or heard the work of multi-instrumentalist, singer/songwriter and composer/arranger  <a href="http://www.kevinfox.ca/" rel="nofollow"><strong>Kevin Fox</strong></a>.<p>Kevin has worked in the studio and on stage with a variety of artists, from Celine Dion to Katharine McPhee to Olivia Newton John. He has spent much of the last seven years touring extensively with award-winning Canadian artists Chantal Kreviazuk and Steven Page. As a composer/arranger, Kevin has composed music for film and television as well as arrangements for artists ranging from Tom Cochrane to Jully Black to Justin Bieber.<p>Kevin is also a singer/songwriter in his own right, with a continually increasing fanbase that began with the release of his first album COME ALIVE and has continued to grow along with the critically acclaimed SONGS FOR CELLO & VOICE and most recently with his 2011 release, SET RIGHT.<p> <p> </p></p></p></p></p>', 'http://toronto.eventful.com/events/kevin-fox-/E0-001-096543660-4?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, NULL);
