INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1120, 'Our Favourite Things - Marion Miller & Clark Bryan', ' <br><br>Date: <br><br>Saturday, April 8, 2017<br><br>Time: <br><br>7:00 PM (Doors Open), 8:00 PM (Show Starts)<br><br>Ticket Price: <br><br>$30 advance / $35 doors <br><br><p>The Aeolian Presents Clark Bryan and Marion Miller<p>Tickets ONLY available through the <a href="http://aeolianhall.ca/events/clarks-signature-series" rel="nofollow">Clark&#39;s Signature Series</a> package until further notice. <br><br> <p>Together Clark and Marion celebrate 15 years of performing and are bringing you their favourite things.<p><strong>MARION MILLER</strong> began piano at four, was teaching at twelve, and entered the University of Western Ontario at 16, where she studied with Clifford Von Kuster and John Paul Bracey, graduating with a Master’s degree in piano performance and the President’s Gold Medal for academic excellence. Canada Council Arts Grants subsequently enabled her to study in Paris with Marcel Ciampi. Other teachers included Cecile Genhart in Zurich and Ozan Marsh in Chautauqua.<p>She has won numerous awards and  competitions, has soloed with orchestras in Canada and the U.S. and recorded several CBC programs as soloist and chamber musician. <p>Always principally a classical artist, she has excelled in other genres as well, putting herself through university partly by playing in a professional swing band, and over the years gaining a varied background in musical theatre as well as performing hundreds of chamber recitals and playing with Orchestra London for many years. She maintains a consistently full studio of piano students ranging in age and level, enjoying teaching and making the main priority always expression insisting that one learn to express rather than just impress.<p>She and Clark Bryan have enjoyed playing together over many years on the same keyboard and as a piano duo. As Clark said  in one interview &quot;we fit like a glove&quot;.<p>In his youth<strong> CLARK BRYAN</strong> trained with longtime pupil of the renowned pianist Géza Anda, Antonia Mazanova. She helped him gain an appreciation for music of all styles. Mr. Bryan did his formal training at the University of Western Ontario.  In 1992 he graduated with both Bachelor and Masters Degrees in piano performance.<p>Mr. Bryan has worked with many of the world’s renowned pianists including Howard Shelley, Jean Paul, Sevilla, Eugene List, Shura Cherkasky, Vladimir Ashkenazy, Ruth Slenczynska and Ronald Turini. Mr. Bryan spent many years working with the celebrated pianist Cécile Ousset both in Paris and the south of France where he refined much of his pianistic and interpretive abilities.<p>Clark’s performance career has taken him to Europe, Mexico the United States and throughout Canada. He has done performances for CBC radio and television including a broadcast recital in 2002 at the Glenn Gould Studio, CBC. He has adjudicated music festivals from St. John’s to Vancouver.  Mr. Bryan has done extensive music editing including the New Millennium Piano Series for Conservatory Canada.  A recent project of note is a book entitled:  “Gateways to Learning and Memory” published in 2009.<p>Mr. Bryan has recorded eleven albums of solo piano and a duo piano album of the Suites for two pianos by Serge Rachmaninoff with duo partner Marion Miller.  His most recent recordings include the complete Chopin Nocturnes.<p>In 2004, Mr. Bryan purchased the Aeolian Performing Arts Centre and School of Music, a magnificent acoustic marvel in London, Ontario. This hall was built in 1883 as the Town Hall for East London and has a rich musical history. In 2009 he shifted the governance of the Aeolian into a registered chariy.  The Hall was  awarded “Best Live Venue in London” (Jack Richardson Music Awards)three times and “Top 10 Venues in Canada” (CBC radio 3).  In April 2011, Mr. Bryan was awarded a Jack Richardson Music Award in the “Contributor” category for his contributions to the musical landscape in the London Community.  In 2011, Mr. Bryan launched El Sistema at the Aeolian, a free UNESCO award winning music program for children and youth.  In January 2016, Mr. Bryan with the approval of his Board of Directors open a new education campus at Bishop Cronyn Memorial Place.  This new home for the El Sistema Aeolian program will also include many other educational programs soon to be implemented.  This new facility also includes a beautiful historic church facility for more artistic presentation.</p></p></p></p></p></p></p></p></p></p></p></p>', 'http://eventful.com/events/our-favourite-things-marion-miller-clark-bryan-/E0-001-096245232-8?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 122);
