INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1145, 'P.A. Day Camps at Ontario Science Centre', ' <p>Escape the ordinary and spend an action-packed day at the Science Centre filled with fun, hands-on discovery. Make new friends, take part in lively science experiments and enjoy exclusive access to the exhibit halls. No parents allowed – kids ages 5-12 only!<p><em><strong>DATES:</strong></em><p><strong>October 7, 2016: Weather Wise  </strong><br> Venture into the new Wild Weather exhibition and explore the meteorological marvels that affect our world.<br><em>Book by October 5, 4 p.m.</em><p><strong>November 18, 2016: Cosmic Quest</strong><br> Explore the night sky and investigate mysteries of our solar system that are out-of-this-world!<br><em>Book by November 16, 4 p.m.</em><p><strong>December 2, 2016: Flight School  </strong><br> Lift off! Build a glider and watch it soar as you experiment with the forces of flight.<br><em>Book by November 30, 4 p.m.</em><p><strong>January 20, 2017: Watts Matter  </strong><br> Spark your curiosity at our new Energy Show and experiment with some super-fun physics of your own.<br><em>Book by January 18, 4 p.m.</em><p><strong>February 17, 2017: (Not So) Simple Machines</strong><br> Explore the new exhibition The Machine Inside: Biomechanics and create a cool contraption inspired by the innovative illustrator, Rube Goldberg.<br><em>Book by February 15, 4 p.m.</em></p></p></p></p></p></p></p>', 'http://toronto.eventful.com/events/pa-day-camps-ontario-science-centre-/E0-001-097001492-9?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 122);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1146, 'Wild Weather at the Ontario Science Centre', ' <p>Wild Weather immerses visitors of all ages in the power and unpredictability of extreme weather. Delve into severe weather science, discover cutting edge technology and investigate the stories of scientists, forecasters and wild weather enthusiasts. Get “struck” by lightning in slow motion and discover how lightning forms. Dance up a storm; the more energy you put in, the bigger the storm!<p>Explore, experiment and brave the elements of intense weather to get a better understanding of the science behind it, its connection to climate change, and emerging technologies and forecasting techniques. Hear the stories of people who are working to better understand these events and help lessen their impact on our communities, infrastructure and lives.<p>Get drawn into the science behind tornadoes, hurricanes, heat waves, thunderstorms and winter storms through interactive exhibits, multimedia experiences, models and large-scale graphics. Experience what it’s like to fly a research aircraft through a hurricane, view the destruction of a tornado, follow turbulent cloud formations and lightning strikes, become a citizen scientist in the midst of a raging winter storm, and meet a researcher studying the force of wind in the lab.<p>Explore different weather phenomena from around the world and common weather myths, and get the chance to be “blown away” in a staged hurricane photo opportunity.<p>Included with Ontario Science Centre admission.</p></p></p></p></p>', 'http://toronto.eventful.com/events/wild-weather-ontario-science-centre-/E0-001-097001496-5?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 122);
