(1173, 'Fall 2016 Okotoks Library -Movers and Shakers', ' Registration Begins August 29, 2016 - 9:00 am Register on line www.litforlife.com or call 403 652-5090  For parents/caregivers with children ages 12 months up to 24 months.  Children and parents/caregivers enjoy time together learning language through songs, rhymes and early learning activities.  Join us for some wiggling, giggling and jiggling!  Programs are offered in partnership with the High River, Okotoks and Sheep River Libraries.  There is no cost for these programs however, Literacy for Life greatly relies on donations from people like you. Thank you! Facilitators: Bonnie and Lisa Dates: (10 sessions) Sept. 21, 28, Oct 5,12,19,26, Nov. 2,9,16,23 Day:  Wednesdays Time: 1:00 - 1:30 pm   ', 'http://calgary.eventful.com/events/fall-2016-okotoks-library-mo-/E0-001-096115858-6@2016111013?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 31);
