(1236, 'SOHO Victoria - The Most Productive Day You''ll Have All Year', ' The second annual SOHO Victoria event is taking place January 27, 2017 at the Victoria Conference Centre. SOHO Victoria is about helping small and home office business owners succeed by empowering them to manage and grow their business, through workshops, 1-1 Expert Advice, peer collaboration and networking. Network with 300 of your peers and get involved in the small business event of the year!', 'http://eventful.com/events/soho-victoria-most-productive-day-youll-have-all-year-/E0-001-044104115-9?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 62);
