(1237, 'A Royal Champagne Afternoon Tea at the Fairmont Empress', ' Royal pinkies up! To honour and celebrate the Duke and Duchess of Cambridge&#39;s upcoming visit to Canada, select Fairmont hotels will be launching A Royal Champagne Afternoon Tea. Featuring the creations of former Royal Pastry Chef Darren McGrady, the new tea menu will include such beloved items as: caramel banana cake (Prince William and Harry&#39;s childhood favourite), coronation chicken mayonnaise bridge rolls (Queen Elizabeth II&#39;s sandwich of choice) and the Royal Chocolate Birthday Cake (a family recipe passed down from Royal chef to Royal chef dating back to Queen Victoria). A Royal Champagne Afternoon Tea will be offered at Fairmont Empress Lobby Lounge from September 30th until November 30th. <p> Chef Darren McGrady will be on hand to launch A Royal Champagne Afternoon Tea at Fairmont Empress on September 30th. A sneak peak of the menu will be offered to a select group of media on September 29th at 3:00pm. </p>', 'http://eventful.com/events/royal-champagne-afternoon-tea-fairmont-empress-/E0-001-043110160-1?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 62);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1238, 'Starman: Acoustic Bowie', ' <p> When Doug Cox first conceptualized Starman:An Acoustic Evening of David Bowie Songs, the thought of it being a posthumous tribute to the influential English rock star was inconceivable. Starman will be presented as a songwriters-in-the-round format, with lead vocals split evenly among band members. Cox has recruited a solid cast of professional musicians, including Juno award-winning singer/songwriter Helen Austin, and Shaun Verreault of Wide Mouth Mason. Other band members include Cox’s long-time collaborator Sam Hurrie, Linda McRae (Spirit of the West), percussionist Robin Layne (Locarno) and Canadian bassist extraordinaire Rick May. Members of the all-star band chose Bowie songs that were meaningful to them, and the results cover his entire career — up to and including a song from his last album, Blackstar, which was released January 2016. Join an inspired, diverse group of Canadian singers/musicians as they celebrate the songs of Bowie in this in-the-round concert performance. <p> General admission: $35 Student/Senior/Alumni: $25 General 4-Pack: $100 </p></p>', 'http://eventful.com/events/starman-acoustic-bowie-/E0-001-096970918-2?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 63);
