(1317, 'MACHINE GUN KELLY', ' <p><p>Richard Colson Baker (born April 22, 1990), better known by his stage name Machine Gun Kelly (or MGK for short), is an American rapper from Cleveland, Ohio, signed to Bad Boy and Interscope Records. His stage name was given for his rapid-fire lyrical flow and is a reference to notorious criminal George “Machine Gun Kelly” Barnes. He rose to fame after releasing his first four mixtapes, Stamp Of Approval (2006), Homecoming (2008), 100 Words and Running (2010), and Lace Up (2010).<ul><li><a href="https://twitter.com/machinegunkelly" rel="nofollow"></a><li><a href="https://www.facebook.com/machinegunkellymusic" rel="nofollow"></a><li><a href="https://www.instagram.com/machinegunkelly/" rel="nofollow"></a></li></li></li></ul><a href="http://www.machinegunkelly.com/" rel="nofollow">Artist website</a></p></p>', 'http://montreal.eventful.com/events/machine-gun-kelly-/E0-001-096692439-1?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, NULL);
