(1325, '2016-2017 Heliconian Club Concert Series', ' FOLK MEETS CLASSIC Friday, October 14, 2016 Experience traditional tunes from Canadian and European composers with singers Maria Soulis,Janet Catherine Dea and Paula Arciniega, flutist Alison Melville, violinist Velma Ko, clarinetist Rita Greer and pianists Evelina Soulis, Jane Blackstone and Louise Morley. Two guests, performing the hurdy-gurdy and bagpipes, will add a folk flavour. VIENNESE SOIRÉE Friday, November 25, 2016 Vienna, the Mecca for many composers, is the subject for our Soirée featuring: pianists Nataliya Lepeshkina (Schubert), Lenore Beatty (Haydn) and Jane Blackstone (Brahms); instrumentalists Louise Morley, Velma Ko and Rita Greer (Mozart); singers Maria Soulis, Janet Catherine Dea and Allison Arends (various composers). VOICES OF SPRING Friday, March 17, 2017 Enjoy Vivaldis Spring performed by Jin Lee Youn, violin and Louise Morley, piano, a movement from Beethovens Spring Sonata with Velma Ko, violin and Jane Blackstone, piano. Hear Broadway stylings sung by Janet Catherine Dea and picture Green as Maria Soulis sings Fauré and Debussy. ALL THAT JAZZ Friday, April 21, 2017 Enjoy Southams jazz-influenced Five Shades of Blue played by Ruth Kazdan, and Kye Marshalls A Blues in A, Eh? and Metronomics with Louise Morley. A string quartet will set our toes tapping with Marshalls arrangement of In the Mood and Scott Joplin Rags. Hear songs of Rodgers & Hart, Gershwin and Cole Porter.<br> <br> 
