VALUES
(1328, 'to have & to hold – the physical book: more than a quaint tradition', ' An Exhibition by Penny Parry Within the next few generations, how many physical experiences will be traded in for virtual ones?  More to the point, what might we as humans lose – how might we change in our basic nature, in such a headlong rush to embrace the virtual?  This mixed media installation will challenge this thought by offering aspects of the ‘physical book experience’ that sharpen and feed our senses. Penny Parry likes to play with ideas.  Her work is based in photography and narrative.  For many years, she has struggled with how to present her work and in doing so, has become more and more interested in the form and function of the book as a physical object.  In undertaking this exploration, the question of the impact of losing this particular experience evolved. Using Alice in Wonderland as inspiration, Parry uses photography, found objects and the creation of a 5 ft story book to invite the viewer to explore the value and joy of the physical book. Come turn some very large pages! Opening: October 14th, 7pm-9pmCraft Council Gallery1386 Cartwright Street, Granville Island Artist Talk: (space is limited please RSVP to attend)October 14th, 6pm-7pm Tyee Room, False Creek Community Center, Granville Island(two buildings east of the Craft Council Gallery) Exhibiton Supported by:     ', 'http://vancouver.eventful.com/events/have-hold-physical-bo-/E0-001-096508318-3@2016111018?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1329, 'Innovate Niagara: Starting Lean: Value Proposition- October 14 & 21, 2016', ' Starting Lean: Value Proposition (2 sessions, 4 hours each) *Doors open at 12:00 pm. Workshop starts at 12:30 pm. Entrepreneur&#39;s Toolkit Workshops are experiential, hands-on workshops facilitated by experienced entrepreneurs. The workshops offer ventures tools, mentoring and peer feedback to solve specific problems and develop essential business components. In each four-hour session you will generate a deliverable that you will use frequently in the business development process. Do you have an idea or a product that you would like to turn into a business? This two-part workshop series is designed to help early-stage ventures understand the Lean Startup approach and learn ways to start collecting feedback from potential customers. The tools and frameworks covered in the workshop will help you to lower the risk associated with launching your new product or business. Our approach will also help new ventures to better understand how sales and marketing activities can be organized to land the first customers. Workshop Schedule Session 1 – Preparing to leave the building October 14, 2016 // 12:30-4:30 pm Establish a process to clarify and test key assumptions you have about your business and lower your ventures overall risk. Deliverable:  Overview of the Lean Startup approach and a tested interview guide based on the venture’s most important foundational assumptions.  Session 2 – Determining your value proposition  October 21, 2016 // 12:30-4:30 pm Use data obtained from customer interviews to synthesize customer feedback into a value proposition. Deliverable: A framework and template for determining your value proposition    Cost of workshops The Entrepreneur&#39;s Toolkit Workshops cost $100 to attend. There are two different ticket types that can be purchased: 1.     ONE Client Refundable Deposit Purchase this ticket if you are a client of: Innovate Niagara St. Catharines Small Business Enterprise Centre Niagara Falls Small Business Enterprise Centre Purchase this ticket if you are a client of a regional innovation centre (Ontario Network of Entrepreneurs). When prompted on the registration page, please list the organization of which you are a member and your current advisor’s name. You will be refunded your full ticket price at the end of the workshop series  and upon completion of our post-workshop survey. 2.     General Attendance Fee Purchase this ticket if you are not currently a member of an organization with the Ontario Network of Entrepreneurs.    **If you are unable to attend a workshop session, please let us know four business days in advance. We regret that failure to do so may result in the loss of your deposit. **The post-workshop survey must be completed within seven days of the last day of a workshop series for a registration deposit or discount to be refunded. If you would like more information on our workshop programs or how to become a client of a regional innovation centre, please contact workshops@marsdd.com.   Find out about new workshops by joining our mailing list.  ', 'http://eventful.com/stcatharines/events/innovate-niagara-starti-/E0-001-095317563-0@2016111012?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 67);
