(1330, 'Wolfpack Youth Volleyball Club', ' Wolfpack Youth Volleyball Program The Wolfpack Youth Recreational Volleyball Club provides local youth ages 5-13 with an opportunity to learn volleyball every Friday (6-7:30pm) at the University of New Brunswick Saint John from October to February. Come join in the fun and learn volleyball skills and more from qualified coaches and Seawolves varsity athletes. Wolfpack also allows for competitive opportunities on age-class teams that compete in a variety of Volleyball New Brunswick tournaments. This program will run from October 14th - December 2nd, picking back up on January 6th - February 24th *PLEASE NOTE: On October 21st there will be no Wolfpack due to a previously scheduled event.   For those who would like to register 3 or more participants there will be a discount of 50% off the lowest registration fee. Please bring completed Registration form and payment to: UNB Financial Services, Oland Hall, 1st Floor between the hours of 9:00am-4:00pm. All other registrations can be done through this online system (1 child). Attached you can find the registration form and waiver, simply fill it out and email to: Stephanie.Guimond@unb.ca  Space is limited in each age category and a waitlist will be formed when maximum participants is reached. Telephone registrations will not be accepted. Full payment is required at the time of registration and particpants must be registered before attending.  Wolfpack Website: www.unb.ca/saintjohn/athletics/programs/wolfpackvolleyball.html  ', 'http://eventful.com/stjohn/events/wolfpack-youth-volleyball-clu-/E0-001-096508166-2@2016111018?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 102);
