(1347, '1964 The Tribute', ' <br> Since the early 80&#39;s, &quot;1964&quot;The Tribute has been thrilling audiences all over the globe with what Rolling Stone Magazine has called the &quot;Best Beatles Tribute on Earth&quot;. &quot;1964&quot; The Tribute takes their audiences on a musical journey to an era in rock history that will live in all of our hearts forever. They are hailed by critics and fans alike as the most authentic and endearing Beatles tribute in the world. Choosing songs from the pre-Sgt. Pepper era, &quot;1964&quot; astonishingly recreates an early 60&#39;s live Beatles concert, with period instruments, clothing, hairstyles, and onstage banter.Over 25 years of researching and performing have made &quot;1964&quot; masters of their craft.Come see why &quot;1964&quot;The Tribute is the definitive Beatles show!', 'http://ottawa.eventful.com/events/1964-tribute-/E0-001-096838424-1?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 122);
