(1377, 'Dear Santa - Holiday Hunt & Charity Evening', ' If you’re wondering what exactly Dear Santa is, think scavenger hunt, meets holiday party, meets awesome charity event, and you&#39;ll have yourself the Dear Santa, Holiday Hunt & Charity Evening! We&#39;ll be sending you and your team across town to participate in whacky activities while helping fill Santa&#39;s sack for families in need. Founded in 2012, we have raised over $30,000 and have helped over 40 local families!! After the scavenger hunt there will be prizes, great food, drinks, music and dancing - all in the name of a good cause! All proceeds are in support of the families who write their “Dear Santa” wish lists to us through the Rose of Durham and Hearth Place Cancer Support Centre here in Durham. ', 'http://eventful.com/events/dear-santa-holiday-hunt-charity-evening-/E0-001-096775490-2?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 44);
