(1383, 'Murder Mystery Dinner Theatre at Grand River Raceway - Fri., Dec. 2, 2016', ' Musical Murder Mystery Dinner Theatre at Grand River Raceway is a hilarious and interactive comedy dinner show. Written and performed for Grand River Raceway by Tim Clarke Productions, these all-original shows change each run with fresh side-splitting storylines and a cast of crazy characters. Enjoy a delicious, homemade 3-course meal as the hilarity unfolds in this unique whodunit night-out with your family and friends. Friday, December 2, 2016: Christmas Show Our annual Christmas Show features a traditional turkey dinner and is full of song and intrigue to lull you into the festive spirit (or spirits?!) of the holiday season. A popular way to celebrate the season with family, friends and co-workers. Doors open at 6:00 pm and the show starts at 6:30. (Show & dinner conclude at 8:30 p.m.) Lighthouse Restaurant at Grand River Raceway • Tickets $49{Price includes taxes, gratuity and $10 gaming voucher (19+)} NO REFUNDS Questions? (519) 846-5455 ext. 288 ', 'http://eventful.com/events/murder-mystery-dinner-theatre-grand-river-raceway-fri-dec-/E0-001-096774688-8?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 59);
