INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1389, 'FKT16PBAD Portfolio for Art/Architecture/Design (14-17) with M.B.J./K.Eic', ' Saturdays 10 weeks/30hrs Portfolio Courses are intended for students who are applying for admission to programs where they are required to submit a portfolio of their art work. This includes both high school visual arts programs as well as post-secondary programs  such as Fine Arts, Architecture, Illustration and Design, including Graphic Design and Advertising, Interior, Fashion and Industrial Design, Environmental Design, Design for Theatre, Video and Installation, Illustration, Animation, and/or any other fine and applied art, or visual art related programs.  In addition to the basics, such as drawing, painting, colour, and composition, the curriculum is content flexible, always considering the up -to -date requirements of the programs chosen by each one of our students. Students will be introduced to basic art and design theory, but the main emphasis is on  the practical studio skills and hands-on projects. Special attention will be given to training students how to properly generate and develop original ideas and concepts, with the objective to prepare and execute projects based on those ideas, while respecting the imposed guidelines and deadlines. Group critiquing and discussions of contemporary issues and trends in the visual art practices is an important  part of the course, helping prepare students for a potential interview, presentation, and/or a hands-on admission test.  ', 'http://toronto.eventful.com/events/fkt16pbad-portfolio-artar-/E0-001-096097327-0@2016111013?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1390, 'FA16MM Mixed Media (B/I/A) with TBD', ' Tuesdays 9:30am-12:30pm for 11weeks/33 hrs This course is materials /techniques based. Roll up your slieves and get your hands dirty while splashing and slashing, pulling and pushing. Unleash your creativity under the gentle guidance of a professional artist/art instructor. Explore and create in a fun, loosley structured, and alvays supportive studio environment. ', 'http://toronto.eventful.com/events/fa16mm-mixed-media-bia-tb-/E0-001-095984202-6@2016111009?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1391, 'FA16OMT Oil Media and Techniques (B/I) with Mahmoud Meraji', ' Mondays 6:30pm-9:30pm 9 weeks/27hrs This class will teach and demonstrate hands-on the traditional oil painting techniques used by the old masters in order to create luminous paintings of still life, portrait, figure, or landscape. From preparing and priming of canvas, palette organizing and mixing of skin tone, to proper use of mediums, through underpainting, layering, glazing and scumbling techniques, you will learn the painting process step-by-step from start to finish. The objective is to produce one classical style portrait from a good tonal contrast photo, one small still life from life, and a small size landscape with a figure in it, also from a photograph. Intermediate drawing skills are an asset, but not required. It is recommended that you carry and use a small sketch book at all times. Materials list will be provided.  ', 'http://toronto.eventful.com/events/fa16omt-oil-media-and-tec-/E0-001-095984102-7@2016111009?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1392, 'FA16APT Acrylic Painting Techniques(B/I/A) with TBD', ' Wednesdays 1:00-4:00pm for 10 weeks/30hrs This course will focus on the medium of Acrylic and it&#39;s painting potential. Students will be introduced to various acrylic materials, such as gels, emulsions, pastes, retarders, extenders and so on. Techniques will be demonstrated and applied while painting on different grounds. Brushes and palette knives will be discussed and their uses demonstrated. By the end of this course students should be quite comfortable executing a more complex acrylic compositions, not affraid to experiment with the Acrylic painting medium. ', 'http://toronto.eventful.com/events/fa16apt-acrylic-painting-/E0-001-095983855-5@2016111013?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1393, 'FA16ULP Urban Landscape Painting (B/I/A) with TBD', ' Tuesdays 6:30-9:30pm for 9 weeks/27hrs If you look at the urban scape and sense it&#39;s soul, or see a kind of beauty that triggers an emotional response, this class is for you. Urban landscape or urban scape, can be many things, as one can find many different things within a city. Students will work from photographs, preferably their own, of urban scenes. The process will include constructing the composition, deciding on a focal point, and choosing scale, size and technique. Instructor will help you by guiding you through the process, and navigate you to explore your own mind, and to search for meaning of chosen image through the painting process. Techniques may be demonstrated, and examples of relevant work shown. Materials list will be given. ', 'http://toronto.eventful.com/events/fa16ulp-urban-landscape-p-/E0-001-095983886-5@2016111018?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1394, 'FA16WP Watercolour Painting (B/I/A) with Marija Barac Jandric', ' Thursdays 9:30am-12:30pm for 10 weeks/30hrs This course is for all who wish to improve their watercolour skills and technique. Each student is approached on their own level and instruction adapted to help every student further develop technically as well as conceptually. As the skills strengthen so does students&#39; confidence. Demonstrations are available, and experiments encouraged, while the students dictate the pace. Materials list will be provided. ', 'http://toronto.eventful.com/events/fa16wp-watercolour-painti-/E0-001-095983872-2@2016111009?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1395, 'FA16W-CAC Be a Curator/Art Conservator with Srebrenka Bogovic Zeskoski', ' Thursdays,  6 weeks/12 hrs Learn what a curator and what an art conservator do. They both take care of artworks but in a vastly different approach. The work of a curator is mostly visual, to display in a given space works of art to their fullest advantage. The art conservator is concern about proper handling, display, storage etc. in order to prolong the longevity of  artworks. Students will learn how to mount an exhibition, how to frame, hung and/or make small repairs when professional assistance is not available. ', 'http://toronto.eventful.com/events/fa16wcac-curatorart-conse-/E0-001-096667443-2@2016111016?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1396, 'FA16PPK Painting Portraits of Kids (B/I) with Jane Mikas', ' Fridays 1:00-4:00pm 9 weeks/27hrs It&#39;s not easy to paint kids portrait well. People mostly just copy from photographs with varying results. In this course we will also work from photos, but we will learn how to &quot;read&quot; the photo, and how to build a natural and believable image of a child capturing the energy and livelyness instead of stiffness.   ', 'http://toronto.eventful.com/events/fa16ppk-painting-portrait-/E0-001-095984133-7@2016111013?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1397, 'FKT16FIP Fundamentals of Illustration/Painting (Grades 6 – 8) with Mike Goodge', ' Wednesdays, 10 weeks/20hrs Afterschool and Youth Program is designed to help spark creativity and let kids express their own ideas and develop imagination through fun and engaging age-appropriate projects and exercises.  Programs that involve Drawing, Painting, Colour, and Illustration, will introduced specific fundamentals and techniques such as the use of line, tone, colour, and texture in achieving a sense of shape, form, depth and movement. Kids will be introduced to basics of concept, composition, perspective, focal point, contrast, and some other elements of visual communication. They will also learn how to mix colour and how to avoid creating a muddy mess on the palette.  Through fun and interesting exercises students will be challenged at their own level, to sharpen their observation and challenge their perception of the visual world.  The program fosters a nurturing yet structured approach and atmosphere, with plenty of personal attention and gentle encouragement.  Non toxic student quality water based media such as acrylic or tempera will be used in the hands-on studio-based approach. ', 'http://toronto.eventful.com/events/fkt16fip-fundamentals-ill-/E0-001-096099044-4@2016111016?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1398, 'FA16MSP Miniature Scale Painting (B/I/A) with TBD', ' Saturdays 1:00-4:00pm 11 weeks/33hrs  There is a long tradition of miniature scale painting throughout art history. This course will adress the historical perspective and some important examples from different periods will be discussed in the class. The scale of the painting plays a major role in miniature art, so it is important to pick the right subject matter and execution in order to create interest. Composition and concept development, along with colour use and application will be discussed with each student separately. &quot;Less is more&quot; is a guiding principal in this discipline.  ', 'http://toronto.eventful.com/events/fa16msp-miniature-scale-p-/E0-001-096658579-4@2016111013?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1399, 'FA16PAR Plein Air at Rosetta McLain Gardens (B/I/A) with Byron Hodgins', ' Monday 9:30am-12:30pm, for 6 weeks /18 hrs  The Mighty 8 x 10 Plein Aire Landscape Painting Plein Air painting is an exciting method of painting outdoors directly from your subject to express the fleeting effects of light, structure, colour. The small, but mighty 8 by 10 sketch has a tremendous ability to hold vitality because of it&#39;s small size which naturally highlights confident and bold painterly approaches. It is suitable for small trips and for on hikes and relaxing visits to the park. This class will introduce the 8 by 10 format and some modern working methods of the Impressionists and Group of Seven that will help you express your own experiences in nature. The outdoor sessions in this class will take place in the beautiful Rosetta Gardens. Individual support for personal aesthetics and for thematic concerns will be addressed in class and on-site while painting. The mightly 8x10 format will unleash your confidence propel your practice to journey into landscape painting. Let&#39;s get started! ', 'http://toronto.eventful.com/events/fa16par-plein-air-rosetta-/E0-001-096014973-0@2016111009?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1400, 'FKT16BWC Build it with Clay (Grade 1 – 3) with TBD', ' Thursdays 4:00-5:30pm, 10 weeks/15hrs This course is a great opportunity for a young student to experience the versatile clay medium, while exploring the possibilities and challenges of making 3D art.  It is an especially good idea for those who are mostly used to expressing themselves in 2D, to start further developing  their tactile senses, and to start thinking spatially. Different clay techniques will be demonstrated and practiced, and projects will be based on observation. ', 'http://toronto.eventful.com/events/fkt16bwc-build-clay-grade-/E0-001-096099058-7@2016111016?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1401, 'FKT16CPMM Collage, Photomontage and Mixed Media (all ages) with S.B. Z.', ' Sundays 2:00pm-4:00pm 10 weks/20hrs Many artists adopted collage to eliminate texture and accentuate colour and shape. Students will be exposed to collages of Pablo Picasso, Jean Arp, Kurt Schwitters and others while encouraged to create their own, original design. Photomontage is a relatively recent attempt to join several images into a new composite. Often that “composite” was photographed to return it into a novel, seamless image. ', 'http://toronto.eventful.com/events/fkt16cpmm-collage-photomo-/E0-001-096097936-2@2016111014?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1402, 'FPF16YS Youth Studio (Grades 6 – 8) with Shoora Majedian', ' Wednesdays 4:00-6:00pm  10 weeks/20hrs Young students are taught the skills of drawing and painting through observation by taking in the world around them and exploring different subject matter ranging from still-life, landscapes, architecture and the human form. Various techniques with pencil, conte, charcoal, watercolour, pen and ink, paint and pastels will be introduced.  Students will move from classical to modern techniques such as impressionism and cubism, with special emphasis on use of complimentary colours to achieve contrast, form and depth.. Starting from short studies in drawing, students will learn how to use those studies to build a painting. Some 3D techniques  and projects will be introduced as well. ', 'http://toronto.eventful.com/events/fpf16ys-youth-studio-grad-/E0-001-096097360-5@2016111016?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1403, 'FKT16AC Art of Cartooning (Grades 4 – 6) with Mike Goodge', ' Tuesdays, 10 weeks/20hrs Our Kids Program is designed to spark creativity, allow kids to express their own ideas and help develop their imagination through fun and engaging age-appropriate projects and exercises.  Courses that involve drawing, painting, colour and illustration will introduced specific fundamentals and techniques such as the use of line, tone, colour and texture in achieving a sense of shape, form, depth and movement. Kids will be introduced to basics of concept, composition, perspective, focal point, contrast and other elements of visual communication. They will also learn how to mix colour and how to avoid creating a muddy mess on their paint palette! Through fun and interesting exercises, students will be challenged at their own level to sharpen their observation and challenge their perceptions of the visual world. The program fosters a nurturing yet structured approach and atmosphere, with plenty of personal attention and gentle encouragement.  Non-toxic student quality water based media such as acrylic or tempera paint will be used in hands-on studio courses. ', 'http://toronto.eventful.com/events/fkt16ac-art-cartooning-gr-/E0-001-096097358-0@2016111016?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
