(1405, 'FKT16CO Cut outs (11 – 14) with Srebrenka Bogovic Zeskoski/M. B. Jandric', ' Fridays 4:00pm -5:30pm 10 weeks/15hrs This class is about working together on a project to create paper “banners” by utilizing negative/positive spaces of various shapes. Shapes are glued in succession and each is conditioned by its neighbour obliging students to consider what was done by the fellow artist and respond accordingly. Cut-outs of Matisse will be used as inspiration.  ', 'http://toronto.eventful.com/events/fkt16co-cut-outs-11-14-s-/E0-001-096099113-3@2016111016?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
