(1407, 'FKT16MMP Drawing, Painting and Mixed Media (Age 6-10) with M.B.Jandric/S.M.', ' Saturdays 10:30am-12:30pm 10 weeks/20hrs Our Kids Program is designed to spark creativity, allow kids to express their own ideas and help develop their imagination through fun and engaging age-appropriate projects and exercises.  Courses that involve drawing, painting, colour and illustration will introduced specific fundamentals and techniques such as the use of line, tone, colour and texture in achieving a sense of shape, form, depth and movement. Kids will be introduced to basics of concept, composition, perspective, focal point, contrast and other elements of visual communication. They will also learn how to mix colour and how to avoid creating a muddy mess on their paint palette! Through fun and interesting exercises, students will be challenged at their own level to sharpen their observation and challenge their perceptions of the visual world. The program fosters a nurturing yet structured approach and atmosphere, with plenty of personal attention and gentle encouragement.  Non-toxic student quality water based media such as acrylic or tempera paint will be used in hands-on studio courses. ', 'http://toronto.eventful.com/events/fkt16mmp-drawing-painting-/E0-001-096097283-7@2016111011?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
