(1408, '6th Annual Proud to be Bullyfree Gala', ' We are pleased to invite you to our 6th annual Bullyfree Gala. If you like having a good time while supporting a great cause and our community please join us for an evening of cocktails, delicous food, amazing entertainment, enviable auction items and hob knobbing with local celebrities including Mayor Jim Watson, our evening emcees Majic100s very own  Stuntman Stu and Angie Poirier aswell as Sens alumni among other surprise guests. Enter Earlybird in promo code to save 10% off. Take advantage before November 15th 2016. ', 'http://ottawa.eventful.com/events/6th-annual-proud-bullyfree-gala-/E0-001-096761267-9?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 44);
