(1409, 'Love in Yeg: A boutique bridal show for authentic couples', ' Behind every great wedding is the perfect team. Come meet yours at Love in Yeg. We carefully select our exhibitors to ensure quality and value in each category. All our vendors are pre-screened and committee approved, to save you time & energy locating the perfect vendors for your big day!  Two admission times to choose from to ensure a personalized experience: Entrance ticket #1 - Gain entry to venue between 11:00am - 12:30pm (stay until close if you&#39;d like!) Entrance ticket #2 - Gain entry to venue between 1:00pm - 2:30 pm (stay until close if you&#39;d like!) Early bird tickets ($15). Tickets $20 (cash only) at the door. Image credit: Kristin Zabos Photography ', 'http://edmonton.eventful.com/events/love-yeg-boutique-bridal-show-authentic-couples-/E0-001-095201766-7?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 122);
