(1411, 'SOHO Nanaimo', ' SOHO Nanaimo is a 1-day business conference at the Vancouver Island Conference Centre on February 3, 2017. It is designed for small & home office business owners, those thinking of starting a business, entrepreneurs, and marketing professionals to connect, explore, network and do business. Get small business advice from our handpicked selection of Canada’s small business leaders. Give your business the edge through insightful talks, expert one-on-one advice, networking opportunities and valuable Q+A sessions with our renowned speakers. Speaker list and agenda coming soon!  The most productive day you will have all year! SOHO Nanaimo is produced by the founders of the successful SOHO Victoria event. Info & tickets to the Victoria event on January 27, 2017. ', 'http://eventful.com/events/soho-nanaimo-/E0-001-096761259-0?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 67);
