(1412, 'Art, Vibes, Fashion - Toronto, ON', ' The Art Vibes and Fashion is a national tour and our purpose is to assist talents of the city with getting local and national exposure. The event will consist of visual artist (painters), fashion designers, boutique owners, singers, comedians displaying their talents in a showcase like setting. If you have interest in participating please send us an email at team@artvibesfashion.com and one of our coordinators will respond as soon as possible. Follow us on Instagram: @artvibesfashion. ', 'http://toronto.eventful.com/events/art-vibes-fashion-toronto-/E0-001-096759390-3?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
