(1416, 'Student Art Curator Program', ' A great opportunity for high school students with a keen interest in art and art related careers. You could be part of an intensive 10-week program gaining behind-the-scenes gallery experience, exploring a variety of art disciplines such as sculpture, printmaking, drawing, painting and more. You will create your own unique masterpieces, curate and install an art exhibit using industry standards. This program can help you make informed decisions about your postsecondary education in the arts. All art instruction will be provided by local artists from the AGB. Program starts October 3, 2016 and ends December 19, 2016 (10 weeks), every Monday evening from 6:30 – 8:30 pm. This program is FREE, however space is limited to 24 participants and registration is mandatory. Good news! Registration deadline was extended to Wednesday September 28, 2016 For additional information please contact rburke@cdhalton.ca Download flyer ', 'http://eventful.com/events/student-art-curator-program-/E0-001-096191099-5@2016111018?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 63);
