(1423, 'FA16MSOP Many Styles-One Painting with Srebrenka Bogovic Zeskoski', ' Thursdays 1:00-4:00pm 10weeks/30hrs Artmaking is a continuous process of growth and exploration. To create a unique work of art in addition to personal inventiveness and imagination, competence, and knowledge makes it possible to bring that work to another level. The course combines theory and practice and aims to expose participants to various art movements which students will “resolve” in their own distinctive creations. Together we will explore how the Old Masters manipulated light and dark, as well as colour and space (especially as practiced during the Baroque period) and compare it with the momentous and a far reaching changes introduced by the Impressionist. We will also explore how “space” was historically resolved on a flat surface and how the twentieth century contemporary artists were keen to negate this, imaginary volume and depth. This course will satisfy a traditionalist as well as a more informal artist keen to experiment. This course will motivate participants’ ability and talent while increasing their skill and knowledge. There will be plenty of time for discussions, class interactions, but also ample “hands on” painting periods. Theoretical portions will be illustrated by visual projections (Power Point presentations).This is an equal opportunity class opened to beginners and advance students; we will all learn from each other. ', 'http://toronto.eventful.com/events/fa16msop-many-stylesone-p-/E0-001-095983923-5@2016111013?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
