(1424, 'FA16CPT Contemporary Painting Techniques (B/I/A) with Shoora Majedian', ' Wednesdays 6:30-9;30pm 11 weeks/33hrs This course focuses on a modern approach to painting a variety of traditional subject matter including still-life, portraiture and landscape. Students are encouraged to develop their own expressive style through the use of colour and paint application. Suitable for all levels. Materials list will be provided. ', 'http://toronto.eventful.com/events/fa16cpt-contemporary-pain-/E0-001-095983808-7@2016111018?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
