(1431, 'FA16FBS Floral and Botanical Studies (B/I/A) with Jane Mikas', ' Fridays 9:30am-12:30pm 6 weeks/18hrs This is a hands-on course for those who wish to strengthen and significantly develop their perception and observation skills. Locations such as Rosetta McLain Gardens will be explored and painted when ever possible. Good drawing skills are welcome but not required, as those will develop in the process. The objective is to finish at least two detailed observational watercolour studies of a single flower and/or plant, and at least one floral/botanical more complex composition. Colour mixing and painting techniques will be demonstrated. This course requires dedication and discipline, while original personal style and ideas are encouraged and nurtured. Important works by various artists will be shown and discussed. Plenty of personal attention and one-to-one feedback. It is recommended that you carry a small sketchbook and HB pencil at all times. Materials list will be provided.  ', 'http://toronto.eventful.com/events/fa16fbs-floral-and-botani-/E0-001-095984003-7@2016111009?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
