(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1432, 'FA16DPVM Drawing and Painting of Various Motifs (B/I/A) Nada Sesar Raffay', ' Thursdays 6:30-9:30pm 10weeks/30hrs Students will learn How to start drawing and painting and how to build an artwork; Using various material: charcoal, pen, pencil, ink, oil  chalk pastel, acrylic paint, oil paint, watercolour, collage and mixed media. Students will learn to understand various medium through experimenting variety of technique and style, from traditional to modern art approach through various thematic/motive.  ', 'http://toronto.eventful.com/events/fa16dpvm-drawing-and-pain-/E0-001-095983995-2@2016111018?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1433, 'FA16WP Watercolour Painting (B/I/A) with Marija Barac Jandric', ' Tuesdays 9:30am-12:30pm for 11 weeks /33hrs Traditional Watercolour requires utmost discipline and focus in order to succeed. It does not tolerate mistakes very well, and trying to recover from them is mostly useless. However, a fast evolving modern technology has also affected the paint industry, creating new materials and changing and altering the properties of existing ones. As a result the medium of watercolour has also changed, allowing it to be much more forgiving and versatile, opening up exciting new opportunities to play and experiment with it much more freely. This course is designed for those ready to “let watercolour loose”, painting outdoors in the Bluffs when weather allows and from own sketches and notes when in the studio. Learn hands-on how to turn “mistakes” into desirable effects, while taking the journey into the unknown watercolour territory. It is recommended that you carry and use a sketchbook and a HB pencil at all times. We will look at important watercolour work of traditional as well as work by some contemporary artists. Plenty of personal attention and one to one feedback available. Materials list will be provided. ', 'http://toronto.eventful.com/events/fa16wp-watercolour-painti-/E0-001-095984014-3@2016111009?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1434, 'FA16PPH Painting from Photographs (B/I) with Marija Barac Jandric', ' Wenesdays 9:30am-12:30pm for 10 weeks/27 hrs As you probably know from experience, it is not simple to paint from a photograph, as the result is often a disappointing flatness and dullness. This course teaches what it takes to translate a photo image into a painting composition. You will learn hands-on how to “read” the photo, and how to select and correctly interpret the visual information captured by the camera. You can work in a medium of your choosing, while it is strongly recommended to carry and use a sketchbook and a HB pencil at all times. Previous drawing and painting experience is a plus, but it’s not a requirement for this course. Materials list will be provided.  ', 'http://toronto.eventful.com/events/fa16pph-painting-photogra-/E0-001-096078245-6@2016111009?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1435, 'FA16DB Drawing Basics (B/I) with Ashley Johnson', ' Wednesdays 9:30am-12:30pm 9 weeks/ 27hrs Hands-on studio-based course for beginners and those who feel that they need a refresher or improvement of their basic drawing skills. In structured step-by-step studio-based exercises designed to develop your technique as well as your perception and observational skills, you will practice using pencil, charcoal, conte, and graphite sticks on paper. Through guided practice you will learn how to achieve the illusion of depth and distance through line, scale, perspective, tonal value, positive and negative space, and proportion. Basic composition will be discussed. Personal attention and one-to-one feedback will be available.  Materials list will be provided.  ', 'http://toronto.eventful.com/events/fa16db-drawing-basics-bi-/E0-001-095983984-6@2016111009?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1436, 'FA16DPPS Drawing/Painting of People, Portraits and Selfies with Nada S. R.', ' Thursdays 1:00-4:00PM for 10 weeks/30 hrs You will learn how to create portraits and self portraits using various materials and techniques, with live models and/or from photography.  INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1437, 'FA16DE Drawing Exploration (B/I/A) with Ashley Johnson', ' Tuesdays 1:00-4:00pm for 10 weeks/30hrs Drawing is so fundamental to human experience that we don&#39;t even think about it much. Kids draw before they learn to speak, and drawing is the first form of creative expression for a child. As we grow up we often forget how much fun drawing can be. This course will shed light on some traditional approaches to formal drawing, but it will mainly show and inspire a more contemporary expression based on the use of line. We will discuss how some drawing materials evolved and changed, while other ones remain the same for centuries and even millenia. A topic of digital drawing will also be addressed in the context of contemporary drawing tools. Be prepared for exploration and discovery on this journey. A lots of personal attention, hands-on-demonstrations, and class critiquing are  essential parts of the course. Materials list will be provided. ', 'http://toronto.eventful.com/events/fa16de-drawing-exploratio-/E0-001-095983891-7@2016111013?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1438, 'FA16FPDL Figure and Portrait Drawing from Life (B/I/A) with Shoora Majedian', ' Wednesdays 1:00-4:00pm 10 weeks/30hrs, model fee included The focus of this course is on exploring ways to capture form, movement and expression working with a live model. We will study short gestures, as well as longer and sustained poses. The course will cover skeletal and musculature aspects of anatomy, as well as basic portraiture. This course is ideal for students wanting to strengthen observational skills, and pursue figurative painting, portraiture, fashion, illustration or animation. Materials list will be provided. ', 'http://toronto.eventful.com/events/fa16fpdl-figure-and-portr-/E0-001-095983881-0@2016111013?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1439, 'FA16IML Impressionist Landscape (B/I/A) with Olga Battaglia', ' Tuesday 1:00-4:00pm 11weeks/33hrs Colour owes it’s existence, and it’s appearance to light. Impressionist technique has resulted from the approach of trying to capture the observed impressions of colour affected by light, rather than the “real colour”. Paintings produced this way are dynamic, full of movement, and exceptionally beautiful. In this course students will work mainly from their own photographs depicting a scene with a strong sense of light and shadow. Emphasis will be on achieving a convincing sense of form, volume and spatial depth using a “colour priority” method of impressionist painting. Students will be coached on colour mixing in order to gain better command of tertiary colours, trying to avoid flatness and pastiness in their work. The objective is to produce at least two paintings per term, in either acrylic or oil or both, depending on what a student will choose to work with. This course is best suited for students with some previous painting experience. Material list provided.  ', 'http://toronto.eventful.com/events/fa16iml-impressionist-lan-/E0-001-095983864-3@2016111013?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1440, 'FA16CPH Collage and Photomontage (B/I/A) with Srebrenka Bogovic Zeskoski', ' Thursdays 6:30-9:30pm for 9 weeks/30hrs Many artists adopted collage to eliminate texture and accentuate colour and shape. Students will be exposed to collages of Pablo Picasso, Jean Arp, Kurt Schwitters and others while encouraged to create their own, original design. Photomontage is a relatively recent attempt to join several images into a new composite. Often that “composite” was photographed to return it into a novel, seamless image. ', 'http://toronto.eventful.com/events/fa16cph-collage-and-photo-/E0-001-095983861-6@2016111018?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1441, 'FA16LDPS Life Drawing and Painting Studio (B/I/A) with Marija Barac Jandric', ' Tuesday 1:00-4:00pm 9weeks /27hrs, model fee included This course provides an opportunity for a sustained study of a pose over a period of several weeks. You will be encouraged to develop a personal approach and style through an informed, guided, and structured process of painting based on observation and keen perception. It is recommended to use water based medium such as acrylic, due to it’s fast drying time and easy care and handling. We will look at and discuss various samples of contemporary figure/portrait art, as well as some examples from art history. The goal is to successfully achieve illusion of form, depth, volume, weight, and space, through scale, proportion, tonal value, perspective, and use of colour. Model fee applies and materials list will be provided.  ', 'http://toronto.eventful.com/events/fa16ldps-life-drawing-and-/E0-001-095983852-8@2016111013?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1442, 'FA16CDT Classical Drawing Techniques (B/I/A) with Mahmoud Meraji', ' Thursdays 1:00-4:00pm for 10weeks/30hrs In the Classical Drawing Techniques course students will learn how to use the lighting in the classical style, as the lighting is essential in the classical technique. In this course, students will identify how to cast lighting on the objects to create a tonality of classical atmosphere. ', 'http://toronto.eventful.com/events/fa16cdt-classical-drawing-/E0-001-095983856-4@2016111013?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1443, 'FA16OMT Oil Media and Techniques (B/I/A) with Mahmoud Meraji', ' Mondays 1:00-4:00pm for 9 weeks /27hrs, model fee included Portraiture is one of the most important and essential skills of the western visual art history. In this course students will learn how to approach  portraiture using &quot;wet-on-wet&quot;, or “alla prima” technique. Special focus will be on the use of large brushes which allow students to capture the expression of the model face. Materials list will be provided ', 'http://toronto.eventful.com/events/fa16omt-oil-media-and-tec-/E0-001-095983851-9@2016111018?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1444, 'FA16CF Colour Fundamentals (B/I) with Jacqueline Schaller', ' Mondays 9:30am-12:30pm for 6 weeks /18hrs This hands-on, studio-based, structured course is based in colour theory and the primary colour palette, and it teaches how to develop proficient and accurate colour mixing. The objective is to help students develop their ability to make intuitive choices regarding proper use and application of colour. You will get to know and be able to use with confidence the colour properties such as saturation, temperature, and value to create a sense of harmony in your work. ', 'http://toronto.eventful.com/events/fa16cf-colour-fundamental-/E0-001-096014863-4@2016111009?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1445, 'FA16ODP Observational Drawing and Painting (B/I) with Dara Aram', ' Mondays 6:30-9:30pm foe 10 weeks /30hrs For total beginners as well as for those with some drawing and painting experience. This course is designed to introduce students to formal approaches to still life. Through structured exercises in observation/ perception of elements such as lite, dark, texture, shape, form and distance, students will go from simple to more complex compositions. Foreground, mid ground and background, artificial horizon and a point of view, will be addressed, and basic aesthetic and stylistic choices will be considered. Important works from various contemporary as well as traditional artists will be discussed. Materials list will be provided.  ', 'http://toronto.eventful.com/events/fa16odp-observational-dra-/E0-001-095983849-4@2016111018?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1446, 'FA16APS Abstract Painting Studio(B/I/A) with TBD', ' Tuesdays 6:30-9:30pm for 11 weeks/ 33hrs This course will introduce the dynamic world of abstraction, also known as non-representational art. You’ll investigate and create works in different abstract genres, learning a wide variety of techniques, and using different approaches to achieve depth, mood, form, space and texture. Learn how to develop your own colour palette and subject matter through exercises in colour and composition. Materials list will be provided. ', 'http://toronto.eventful.com/events/fa16aps-abstract-painting-/E0-001-095983848-5@2016111018?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
