VALUES
(1447, 'Swim Kids 2/3', NULL, 'http://eventful.com/events/swim-kids-23-/E0-001-096742987-5?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 102);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1448, 'FA16APF Acrylic Painting Fundamentals (B/I) with Ashley Johnson', ' Tuesday 9:30am-12:30pm for 10 weeks /30hrs You will be introduced to the process of painting using acrylic and acrylic gels and mediums. Acrylic is essentially plastic, and it is opaque by nature. In order to make it behave differently, and become glossy or transparent for example,  you need to use acrylic mediums. Acrylic is a water based paint,  easy to start using but it takes time to get to know it well and be able to manipulate it the way you want it. The course will teach some finer techniques and approaches to paiting with acrylic, and demonstrations will be given. Colour mixing will be explained and demonstrated, as well as different application techniques. Important work in acrylic will be shown and class critiquing conducted. Personal attention and feedback will be given. Materials list will be provided.  ', 'http://toronto.eventful.com/events/fa16apf-acrylic-painting-/E0-001-095984146-1@2016111009?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1449, 'FA16CRAS Classical Realism Advanced Studio (I/A) with Mahmoud Meraji', ' Thursdays 6:30-9:30pm for 10 weeks/30hrs, The students in this course will became familiar with the visual art  language including composition and colour theories, and they will also become more familiar with art history. Requirement for this course is basic to intermediate knowledge of drawing and painting studio techniques, so that a student can learn in this course how to find out their own artistic style. ', 'http://toronto.eventful.com/events/fa16cras-classical-realis-/E0-001-095984107-2@2016111018?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1450, 'FA16IP Impressionist Painting (B/I) with Jane Mikas', ' Wednesdays 9:30am-12:30pm for 9 weeks/27hrs Impressionist approach is a result of studying the effects of light on the appearance of colour. Paintings produced this way are dynamic, full of movement, and exceptionally beautiful. In this course students will work mainly from their own photographs depicting a scene with a strong sense of light and shadow. Emphasis will be on achieving a convincing sense of form, volume and spatial depth using a “colour priority” method of impressionist painting. Students will be coached on colour mixing in order to gain better command of tertiary colours, trying to avoid flatness and pastiness in their work. This course is best suited for students with some previous painting experience. You can work in either acrylic or oil. Material list provided.  ', 'http://toronto.eventful.com/events/fa16ip-impressionist-pain-/E0-001-095984091-2@2016111009?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
