(1474, '2017 ISU World Junior Synchronized Skating Championships', ' <p> <p>For the first time ever, Canada will host the ISU World Junior Synchronized Skating Championships in 2017. The championships will take place from March 10-12, 2017 at the Hershey Centre in Mississauga, Ont. Twenty-five of the top junior synchronized skating teams from 20 countries will compete for the junior world title.<p>&quot;It is always an honour to host international events and we are excited to be hosting the ISU World Junior Synchronized Skating Championships for the first time,&quot; said Dan Thompson, CEO, Skate Canada. &quot;Canada has a fantastic track record of hosting synchronized skating events. Most recently we hosted the 2015 ISU World Synchronized Skating Championships which was an extremely exciting event with Canada winning gold on home soil. We look forward to hosting the world once again in 2017.&quot;<p>The ISU World Junior Synchronized Skating Championships was a biennial event but it was recently decided at the 2016 ISU Congress that the event will become annual beginning in 2017. The inaugural event was hosted in 2013 by Helsinki, Finland. In 2015, Team Canada (Les Suprêmes) won the nation’s first medal at the championships, a bronze.<p>Ticket prices and information will be available later this year. Please check skatecanada.ca for updates.</p></p></p></p></p>', 'http://toronto.eventful.com/events/2017-isu-world-junior-sy-/E0-001-096711149-9@2017031000?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 102);
