VALUES
(1475, 'Gary Martin and the Heavenly Blues', ' Gary Martin - Chicago Blues Master known as &quot;The Prince of Blues&quot; by his peers. Martin a resident of both Chicago and Calgary is working on a CD as a tribute to his late uncle and mentor Hubert Sumlin, collaborating with some of Chicago&#39;s finest legendary blues masters. Martin performs throughout North American and has recently been asked by the President of Sierra Leone to perform at a series of concerts in Africa. He recently performed at a private function for the US Ambassador to Canada at the request of the US Consulate General. As an ethnomusicologist, Martin is often requested to lecture on the &quot;History of the Blues&quot; at universities and colleges.', 'http://calgary.eventful.com/events/gary-martin-and-heavenly-blues-/E0-001-096706817-9?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, NULL);
