(1476, 'Dice Deluxe', ' Between the Badlands of Alberta and the Rocky Mtns, Dice Deluxe formed a unique blend of swampy jump blues and hoodoo boogie! A 3piece band from Calgary, writing and performing original music about local places and icons, as well as putting their stamp on some great cover tunes. The band plays in and around the Southern Alberta area.', 'http://calgary.eventful.com/events/dice-deluxe-/E0-001-096706815-1?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, NULL);
