(1481, 'LOSS OF SPOUSE (10-WEEK GRIEF SUPPORT PROGRAM)', ' This 10-week peer support program is aimed to support individuals through a deeper exploration of their grief experience following the loss of a spouse. The program provides a safe and supportive space to be in grief, to share and to listen; where those who’ve experienced the loss of their spouse can connect with others who’ve experienced a similar loss. Peers help reduce the isolation that many people experience in grief and provide hope that healing is possible. This peer support group is facilitated by trained facilitators who’ve also experienced the loss of a spouse, received support and want to help others heal.The program is also supervised by a professional consultant and practioner. Attendance is limited to 12 participants who must meet eligibility criteria. (Please see registration form for more details.) The program will run every Tuesday, from 7:00 to 9:00 p.m., from October 6th to December 8th, 2016. Since Bereaved Families of Ottawa doesn&#39;t get any governmental funding and relies solely on donations to deliver its programs, the suggestion donation for this program is $250 (with income tax receipt). If you don&#39;t have the ability to make a donation or just can make a partial donation, please contact our offices at 613.567.4278 or office@bfo-ottawa.org.  ', 'http://ottawa.eventful.com/events/loss-spouse-10week-grief-s-/E0-001-095387315-8@2016111019?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 54);
