(1573, 'Royal Winnipeg Ballet Recreational Division’s Fall/Winter Program', 'Students will have the opportunity to learn from the very best, world-renowned instructors from the RWB’s Recreational Division faculty from Sept. 11, 2016 to June 15, 2017.  There are a number of different and exciting classes to choose from: Movers and Shakers I and II, Creative Movement I and II (plus a combination class with either Tap, Jazz and Ballet) for pre-schoolers aged 3 to 5; Mighty Movers I and II, Power Movers, Ballet Levels I + II for boys aged 4 to 9; Ballet, Jazz, Pointe, Tap, Musical Theatre, Lyrical, Hip-Hop and Modern for children and teens aged 6 to 17; Ballet, Jazz, Tap, Modern and ExplorAbility for adults 18 and above; and  ExplorAbility for youth aged 13 to 17. Find out more information by visiting http://rwb.org/school/recreational-division/programs-rec/fall-winter-regular-session or call the RWB School office at (204) 957-3467.', 'http://eventful.com/winnipeg/events/royal-winnipeg-ballet-recre-/E0-001-093803958-4@2016111000?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
