(1706, 'Richmond Green Library Evening Book Club: Fall 2016', ' Meet once a month to discuss books in a relaxed, welcoming environment. Meetings occur from 7:00 to 7:45 pm in the Richmond Green Library Classroom. Thursday, September 29, 2015: All My Puny Sorrows by Mariam ToewsThursday, October 27, 2016: Prodigal Summer by Barbara KingsolverThursday, November 24, 2016: Crow Lake by Mary Lawson ', 'http://toronto.eventful.com/events/richmond-green-library-ev-/E0-001-094964109-3@2016111019?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 60);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1707, 'Condo 101- Board Basics and Best Practices', ' This introductory course will assist Condominium Board Members understand their roles and obligations to better serve their complex. We will cover the basics of Board Governance, Financial and Maintenance responsibilities as well as common legal obligations. Our goal is for you take away a number of best practices to review and implement within your condominium. This seminar is FREE to all paid CCI Condominium and Individual member only however non-members may enroll at a cost of $50.00/person including GST. ', 'http://edmonton.eventful.com/events/condo-101-board-basics-a-/E0-001-094775132-3@2016112609?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 122);
