VALUES
(1784, 'Formations Concepteur et Consultant certifié "Passivhaus" 2016', ' Formation pour Concepteurs et Consultants certifiés «Passivhaus».Cette formation complète, offerte en collaboration avec Maison passive France, est recommandée pour la préparation à l&#39;examen de l&#39;Institut &quot;Passivhaus&quot;. Tous les cours ont lieu au Centre Saint-Pierre à Montréal selon le calendrier suivant: 17-18 septembre 2016: bloc A  Le standard « Passivhaus » (1/2 journée) Enveloppe du bâtiment (1 1/2 journée) 28-29-30 octobre 2016: bloc B  Ventilation bâtiment passif (2 jours) Production / Alimentation de chaleur (1 journée) 18-19-20 novembre 2016: bloc D  Fenêtre / Étanchéité à l’air (1 journée) Calcul économique (1/2 journée) Complément de formation (1/2 journée) Révision (1 journée) Il est possible de s&#39;inscrire par bloc, vérifiez la disponibilité des cours.  FAQ Que peut-on apporter et que ne peut-on pas apporter à l&#39;événement? Apportez votre dîner! Visitez notre site Internet pour vous procurer l&#39;outil PHPP   Comment puis-je contacter l&#39;organisateur si j&#39;ai des questions? info@maisonpassivequebec.com   Puis-je transférer mon billet ou mon inscription? S&#39;il n&#39;y a pas de liste d&#39;attente, il est possible de le faire. Contactez-nous pour vérifier.   Quelle est la politique relative aux remboursements? Comme les formateurs auront été payé pour un nombre minimum d&#39;inscription, aucun remboursements ne sera acceptés passé la date limite d&#39;inscription (voir sur la page d&#39;inscription de chaque Bloc).   ', 'http://montreal.eventful.com/events/formations-concepteur-et-/E0-001-094533481-2@2016111009?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 100);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1785, 'Knowledge Integration seminar series', ' <p>INTEG 10 is a seminar on transdisciplinary topics and integrative practices which are of special interest to Knowledge Integration students.  This is the &quot;living room&quot; of the program; a place where ideas come together.<p>We welcome friends and visitors!<p>Each session features a different guest speaker and is open to all students, faculty, staff, alumni and members of the public.  We encourage sparkling and lively discussion between speakers and audience members.<br><strong>Upcoming speakers</strong><br><p><a href="https://uwaterloo.ca/knowledge-integration/events/knowledge-integration-seminar-series/fall-2016" rel="nofollow">Fall 2016</a> <br><strong>Previous speakers</strong><br><p><a href="https://uwaterloo.ca/knowledge-integration/events/knowledge-integration-seminar-series/winter-2016" rel="nofollow">Winter 2016</a> | <a href="https://uwaterloo.ca/knowledge-integration/events/knowledge-integration-seminar-series/fall-2015" rel="nofollow">Fall 2015</a> | <a href="https://uwaterloo.ca/knowledge-integration/events/knowledge-integration-seminar-series/winter-2015" rel="nofollow">Winter 2015</a> | <a href="https://uwaterloo.ca/knowledge-integration/events/knowledge-integration-seminar-series/fall-2014" rel="nofollow">Fall 2014</a> | <a href="https://uwaterloo.ca/knowledge-integration/knowledge-integration-seminar-series-winter2014" rel="nofollow">Winter 2014</a> | <a href="https://uwaterloo.ca/knowledge-integration/knowledge-integration-seminar-series-fall2013" rel="nofollow">Fall 2013</a> | <a href="https://uwaterloo.ca/knowledge-integration/knowledge-integration-seminar-series-winter2013" rel="nofollow">Winter 2013</a> | <a href="https://uwaterloo.ca/knowledge-integration/knowledge-integration-seminar-series-fall2012" rel="nofollow">Fall 2012</a> | <a href="https://uwaterloo.ca/knowledge-integration/knowledge-integration-seminar-series-winter2012" rel="nofollow">Winter 2012</a> | <a href="https://uwaterloo.ca/knowledge-integration/knowledge-integration-seminar-series-fall2011" rel="nofollow">Fall 2011</a> | <a href="https://uwaterloo.ca/knowledge-integration/knowledge-integration-seminar-series-winter2011" rel="nofollow">Winter 2011</a> |<a href="https://uwaterloo.ca/knowledge-integration/knowledge-integration-seminar-series-fall2010" rel="nofollow">Fall 2010</a> | <a href="https://uwaterloo.ca/knowledge-integration/knowledge-integration-seminar-series-winter2010" rel="nofollow">Winter 2010</a> | <a href="https://uwaterloo.ca/knowledge-integration/knowledge-integration-seminar-series-fall2009" rel="nofollow">Fall 2009</a> | <a href="https://uwaterloo.ca/knowledge-integration/knowledge-integration-seminar-series-2008-2009" rel="nofollow">2008 - 2009</a></p></p></p></p></p>', 'http://eventful.com/events/knowledge-integration-seminar-series-/E0-001-096193815-9@2016111114?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 75);
