VALUES
(1786, 'Small Wonders: Gothic Boxwood Miniatures', ' <p>Marvels of human ingenuity, so small they can fit in the palm of your hand, miniature boxwood carvings from the early 1500s have long remained a mystery.The AGO is pleased to debut <b><i>Small Wonders: Gothic Boxwood Miniatures, </i></b>a groundbreaking exhibition of more than 60 boxwood miniatures organized in partnership withThe Metropolitan Museum of Art and the Rijksmuseum. Offering new insight into the methods of production and cultural significance of these awe-inspiring works of art, this exhibition highlights more than four years of research that has used cutting-edge technology to understand these elegantly precise miniature rosaries, prayer beads and altarpieces.</p>', 'http://toronto.eventful.com/events/small-wonders-gothic-boxw-/E0-001-096192500-3@2016111000?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 47);
