(1787, 'TEDxUW', ' <p>TEDxUW is a key player in the global TED movement, which aims to share ‘ideas worth spreading’, for free, across the world. TEDxUW has brought many brilliant minds together in order to network, share ideas, and change and challenge perspectives on our ever-changing world.<p>Through its roster of brilliant speakers made up of thought leaders such as: Olympic medalist Heather Moyse, rising entrepreneurs like Dave Wilkin, and charismatic economists like Larry Smith, TEDxUW aims to further the discourse on innovation and excellence.</p></p>', 'http://eventful.com/events/tedxuw-/E0-001-096193826-5?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 75);
