(1835, 'Signing Naturally 202 - Fall 2016 (10-week)', ' Deaf Alberta is the premier provider of this curriculum-based course for those wanting to learn the beauty and nuances of this visual language.  Participants are able to progress in their learning through sequential levels of difficulty.  The Signing Naturally series is recognized as the curriculum for serious students wishing to learn ASL, and is the first step towards becoming a sign language interpreter in Alberta. Signing Naturally 202 Students in level 202 will continue to work on their conversational skills, while learning about narrative structure and transitions. Details: Thursdays - 6:30 PM to 9:00pm Sept 15 - Nov 17sure, 2016 ', 'http://calgary.eventful.com/events/signing-naturally-202-fa-/E0-001-095941163-1@2016111018?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 63);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1836, 'Thunder Bay PEERS Social Skills Program Fall 2016', ' PEERS (Program for the Education and Enrichment of Relational Skills) is a 14-week evidence-based social skills training for motivated teens on the Autism Spectrum, in grades 7 to 12, who are interested in learning ways to help them make and keep friends. During each group session, teens are taught important social skills and are given the opportunity to practice these skills in session during activities (e.g. playing sports, board games, etc.). Parents are taught how to assist their teens in making and keeping friends by providing feedback through coaching during weekly socialization homework assignments. Enrollment is limited. Classes are on Thursday evenings starting September 15th from 6:30 – 8:00 pm. At Autism Ontario Office 425 North Edward Street Northwood Park Plaza (Registration does NOT confirm participation in program you must go through a phone screening to determine if the program will fit your needs). ', 'http://eventful.com/thunderbay/events/thunder-bay-peers-social-/E0-001-094215091-8@2016111018?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 122);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1837, 'Autism Ontario - PEERS - Oakville', ' Registration will open June 15, 2016 at 1pm PEERS - Social Skills Training   Teens with high functioning ASD, in grades 8-12 are invited to this 12-week evidence-based social skills workshop.    PEERS (Program for the Education and Enrichment of Relational Skills) is geared towards motivated high functioning teens who are interested in learning ways to help them make and keep friends.   During each group session adolescents are taught important social skills and are given the opportunity to practice these skills in session during socialization activities (e.g. playing sports, board games, etc.).   During the course of this 12 week program, children will learn: conversational skills, how to make a good first impression, how to “play detective” to find common interests, how to join a group of kids at play, how to handle rejection, teasing and bullying, how to be a good host on a play date, how to be a good winner, how to be a good sport, and how to show respect towards adults.   Regular attendance is imperative.   Parents Parent participation is required at each session.  Parents are taught how to assist their teens in making and keeping friends by providing feedback through coaching during weekly socialization homework assignments.   Open to: - Teens (Grades 8-12) - And with high functioning ASD FeesFees for this program are $100.00 per child.  Monarch House will conduct the pre-screening for children that register for this program to ensure suitability.  They will collect the $100 program fees from families who successfully meet the eligibility requirements. Monarch HouseThis training will be facilitated by Monarch House, who is an innovative healthcare organization dedicated to the advancement of best practices, offering a network of interdisciplinary clinical experts. They provide evidence-based treatment for individuals from infancy to adulthood requiring services in the areas of challenging behaviour, language and communication, motor skills, recreation, vocational skills, daily living skills, social skills, and overall learning.   Dates Every Thursday for 12 weeks (including a graduation celebration) Thursday, Sept 15, 2016 - 6:00pm - 7:00pmThursday, Sept 22, 2016 - 6:00pm - 7:00pmThursday, Sept 29, 2016 - 6:00pm - 7:00pm Thursday, Oct 6, 2016 - 6:00pm - 7:00pmThursday, Oct 13, 2016 - 6:00pm - 7:00pmThursday, Oct 20, 2016 - 6:00pm - 7:00pmThursday, Oct 27, 2016 - 6:00pm - 7:00pm Thursday, Nov 3, 2016 - 6:00pm - 7:00pmThursday, Nov 10, 2016 - 6:00pm - 7:00pmThursday, Nov 17, 2016 - 6:00pm - 7:00pmThursday, Nov 24, 2016 - 6:00pm - 7:00pm Thursday, Dec 1, 2016 - 6:00pm - 7:00pm A follow-up will happen 6 month after the training is complete.  Details to follow later.   Notes **Pre-Screening Required to Determine Eligibility**; Registration is required - but does not guarantee participation;   Caregivers are required to participate during all sessions;   Supervision of children/youth at this Social Learning Opportunity is the sole responsibility of parents/guardians and caregivers; Due to allergies and sensitivities, please refrain from wearing perfume, cologne, aftershave, or scented products such as hairspray or lotion;   Refunds will not be giving once the screening process has been completed. ', 'http://toronto.eventful.com/events/autism-ontario-peers-o-/E0-001-095130510-3@2016111018?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 122);
