(1838, '102 Introduction to Life Drawing (F''16) - Martha Eleen', ' INTRODUCTORY-INTERMEDIATE LEVEL Thursdays, 10am-1pm, Sept. 15 - Dec. 1 102 Introduction to Life Drawing This course emphasizes basic drawing skills in gesture, contour, and tone. It is designed to teach students the skills necessary to render the figure in three dimensions, in both wet and dry media. Instruction in surface anatomy and proportion is included. Class sessions are upbeat with lots of personal attention. Media: Charcoal, conté, ink, newsprint. Note: It is recommended that students have taken an Introduction to Drawing course or have some drawing experience.  Instructor: Martha Eleen Time & Dates: Thursdays, 10am-1pm, Sept. 15 - Dec. 1 Tuition: $460 + Model fee: $95 + admin fee ________________________________________ Materials List Basic Supplies: Charcoal: Vine (Willow) charcoal Conte: orange and black Ink, Chinese bamboo brush, nibs and pen Oil pastels (Pentel or Selectum are inexpensive (under $4) White plastic eraser masking tape or bull clips Cartridge or bond paper (white, 18” x 24”) Thicker paper such as watercolour (smooth) or printmaking paper to support ink and washes. Try a variety of papers: manilla, craft, vellum, and mylar. ', 'http://toronto.eventful.com/events/102-introduction-life-dra-/E0-001-094658887-2@2016111010?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
