(1839, 'Signing Naturally 103 - Fall 2016 (10-week)', ' Deaf Alberta is the premier provider of this curriculum-based course for those wanting to learn the beauty and nuances of this visual language.  Participants are able to progress in their learning through sequential levels of difficulty.  The Signing Naturally series is recognized as the curriculum for serious students wishing to learn ASL, and is the first step towards becoming a sign language interpreter in Alberta. Signing Naturally 103 This course expands the basics and will provide anyone with limited former knowledge of ASL a basic level of competency.  It covers everyday language and phrases, and includes information on Deaf culture. You need to have completed ASL 101 and 102 before taking this course. A new textbook is required as it covers ASL 103 and 104. Details: 6:30 PM to 9:00pm Sept 15 - Nov 17, 2016 Thursdays ', 'http://calgary.eventful.com/events/signing-naturally-103-fa-/E0-001-090312194-4@2016111018?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 63);
