(1840, 'Wine & Words Season Ticket', ' Enjoy celebrated Canadian authors paired with exceptional Canadian wines. Each month will feature an author, live at a local winery. Season tickets are $150. Each author&#39;s latest novel will be paired with a local VQA wine from the host winery. Ticket includes a glass of wine and food pairing. The authors will discuss their latest work, give the audience an opportunity to ask questions and purchase a signed book. Doors open at 6:45 pm and the presentations begin at 7:00 pm.  The ticket will be valid for all of the following events: September 15 - Andrew Westoll at Stratus Vineyards October 5 - Jennifer Robson at Reif Estate Winery November 2 - Andrew Pyper at Konezelmann Estate Winery Febraury 15 - Emma Donoghue at Peller Estates Winery March 1 - George Elliot Clarke at Southbrook Vineyards April 5 - Sally Christie at Caroline Cellars ', 'http://eventful.com/events/wine-words-season-ticket-/E0-001-095969222-7@2016111019?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
