(1841, 'Deeper 1: Prophetic Gifting and Ministry Today', ' Deeper Mixed Group: Men, Women & Youth – Sept 15 & 29; then 1st & 3rd Thursday till Dec 1 Deeper Women’s Group: Women & Youth – Sept 15 & 22; then 2nd & 4th Thursday till Dec 8 One of the core ways for a Christians to develop and deepen a relationship with the Lord is to learn how to hear God’s voice. When a Christian learns to hear God’s voice for themselves a natural and logical progression is to hear God’s voice for others so the family of God will be - encouraged, strengthened and comforted (I Corinthians 14:3). Hearing God’s voice for others is what the Bible calls the gift and ministry of prophecy. The art of hearing God’s voice for oneself and others is best practiced with discernment, good stewardship, in a community of believers and in alignment with God’s Word. The purpose of the Deeper I learning experience is to provide an environment for you to learn about and to practice hearing God’s voice for oneself and for others. Our times together will involve worship, teaching, and practical exercises. The teaching sessions will include the following topics: Abiding in Jesus Engaging with Holy Spirit Ways that God Speaks Continuing to Grow in Hearing God’s Voice Stewarding Truth Dreams Old and New Testament Prophecy and Prophets Operating in the Purity of the Gift of Prophecy How to Give a Prophetic Word to Others How to Steward Prophetic Words that Others have Given to You Words of Wisdom & Words of Knowledge Facilitator: Deanna Oelke Start Date: September 15, 2016 End Date: December 8, 2016, 2 times a month Start Time and End Time: 6:45 – 9:30 PM ', 'http://calgary.eventful.com/events/deeper-1-prophetic-giftin-/E0-001-095760855-2@2016111018?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 122);
