(1842, 'North Toronto Theatre Arts Beginner', ' This Fall the students will be working on the play &quot;Who&#39;s Story Is This?&quot; Something has gone wrong in the land of Fairy Tales and all the characters are in the wrong stories! How will they find their way to a happy ending if they don&#39;t know where they are or who they&#39;re supposed to be? The students in our beginner class will learn all the basics of stagecraft through the process of putting on a play. They will play improv games, learn how to speak loud and proud on stage, stage right from stage left and how to work as part of a team! ', 'http://toronto.eventful.com/events/north-toronto-theatre-art-/E0-001-095442399-6@2016111017?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
