(1843, 'ASM Edmonton Educational Course: Metallurgy for the Non-Metallurgist', ' Educational Course Metallurgy for the Non-Metallurgist An introduction to all the elements of metallurgy, which is suitable for those people working in metals-based industries who do not have a degree or diploma in materials engineering. Begins Sept. 15, 2016 Limited to 25 students   Course Location: University of Alberta Edmonton, Alberta Building: NREF Classroom: NRE 2 020 Nearest Parking off 116 ST NW: Faculty Club Parking ($2) Windsor Car Park ($5; 110V plug in) WHO SHOULD TAKE THE COURSE? Personnel who do not have formal knowledge of metallurgy and materials concepts. Those interested in understanding how deeper understanding of materials can lead to better productivity. People involved in asset integrity, pipeline integrity, operating facilities, and any other industry that makes use of materials. Practical familiarity with high school chemistry and physics is advantageous. Please bring a scientific calculator to this course. This course is a valuable pre-requisite for taking more technically challenging courses for further career development; ASM Edmonton also offers courses in Corrosion and Failure Analysis, among others.   Course INSTRUCTORS The course instructors are prominent professors and instructors at the University of Alberta with years of experience teaching.   Venue and Dates The program will run from 6-9PM for 14 weeks starting Thursday, Sept. 15th and run every week until December 15th, 2016. The course material has 14 lessons, so there will be one lesson about every week.  The lessons have been developed by ASM International and their average length is about 25 pages so it will take approximately one hour for the participants to read the lesson in preparation for the next lecture. The University of Alberta has many top notch classroom facilities. Parking is located at either the Faculty Club Parking Lot off 116 ST NW for $2/night after 4:30 PM or Windsor Car Park off 116 ST NW for $5/night after 4:30 PM. The University is also conveniently accessed by transit.   COSTS AND BENEFITS The program fee for this course will be $1200 for ASM members, $1300 non-members, and $500 for Students.  The program fee includes the course notes from ASM International and professional membership in ASM International if you are not already a member (a US$117 value).  If you took this course at ASM headquarters in their 5 day format the course alone would cost over $2,000, plus travel to and lodging in Ohio. If you or your staff want to upgrade your knowledge through continuing education we encourage you to enroll now. It will be at least two years before we will be able to repeat this course. Successful completion of the course will include an internationally recognized completion certificate. The course includes online exams, which will help you master the materials and to keep you on track in your learning.   WHAT YOU’LL LEARN Describe how metals and behave, and why; including why and how they can be formed. Recognize how metals can be strengthened by alloying, cold-working, and heat treatment Determine why metals and alloys are not behaving as expected and how they can be made to behave as needed. Choose what metal or alloy to use for specific combinations of properties.   COURSE OUTLINE   1.    Metals: A History: History of the discovery of the major commercially important metals; the first primitive refining techniques; brief descriptions of cultural significance of metals. 2.    Extractive Metallurgy: Techniques used to win metals from mineral ores, including hydrometallurgical, pyrometallurgical, and electrometallurgical techniques. 3.    Solidification of Metals: Introduction to the science of metallurgy, including crystal structure; concepts of solidification and solid solubility; basic binary phase diagrams. 4.    Metal Forming: Forging, rolling, extrusion, swaging, and other techniques employed to form metals at elevated temperatures; rolling, stamping, coining, spinning, and other techniques used to form metals at ambient temperatures. 5.    Mechanical Properties and Their Measurement: Definitions of mechanical properties and explanations of testing procedures; introduction to concepts of standardization and quality control. 6.    Steels and Cast Irons: Applications and Metallurgy: Description of the allotropic nature of iron and its effect on the properties of steels and cast irons; listing of selected applications of steels and cast irons. 7.    Heat Treatment of Steel: Hardness and hardenability of steel; specific processes and their applications; heat treating procedures, equipment, quenchants, and hardness measurements. 8.    Case Hardening of Steel: Techniques used to harden the case of a metal, including carburizing, nitriding, carbonitriding; procedure for measuring case depth. 9.    Strengthening Mechanisms: Techniques used to harden the nonferrous metals, including age hardening, strain hardening and related metallurgical concepts for aluminum, titanium, copper, and other nonferrous metals. 10.Nonferrous Metals: Industrial Applications and Properties: Light metals, aluminum, beryllium, magnesium, and titanium; copper and its alloys; lead, tin, and zinc; precious metals. 11.Joining: Techniques of welding, brazing, and soldering, including descriptions of specific applications of each process described. 12.Corrosion and Corrosion Prevention: Causes of corrosion and the environmental factors which contribute to it; types of corrosion are discussed, together with techniques for minimizing it. 13.Quality Control and Failure Analysis: Procedures for predicting and/or evaluating the performance of metals in service. 14.Materials Characterization and the Selection Process: Explanation of the designation systems for classes of metals and alloys in worldwide use today; descriptions of factors which affect the selection of a material for a particular application; brief comparison of polymers and ceramics related to metals; case studies of material selection problems. When you complete the online tests for this course you will receive a certificate for 3.0 CEU (Continuing Education Units), part of ASM’s system of courses to allow members to upgrade their qualifications.  CEU are also recognized by APEGA and ASET as continuing education for Professional Development Hours.   PRICING ASM & Affiliate Society Members (AWS, CWA, ASME, NACE, SME) $1200 Non-Members (Includes a 1 year ASM International Subscription) $1300 Students $500 NOTE: GST is included in the prices. Receipts will be issued at the event. REGISTRATION BY EVENTBRITE Eventbrite allows for easy registration and fee payment by credit card. Please follow the link below to register. http://asm-2016-education-course.eventbrite.com/ Or search for “Metallurgy for the Non-Metallurgist” in “Edmonton, Canada” at www.eventbrite.ca REGISTRATION BY CHEQUE Please register through Eventbrite and select the “Cheque” ticket type. Following registration, please contact the course coordinator (contact information below) and send a postdated cheque (September 1, 2016) for $200 to reserve your place; the remaining fee is due at the first class. Make cheques payable to: “ASM International – Edmonton Chapter” Mail cheques to: ASM International – Edmonton Chapter c/o Matthew Bell 5311 – 86 St NW Edmonton, Alberta T6E 5T8 COORDINATOR CONTACT INFORMATION For more information contact the ASM Course Coordinator Prof. Weixing Chen by: Email: weixing.chen@ualberta.ca Phone: 780-492-7706 (days) Thank you for your interest! If you have questions about other ASM Edmonton events please visit our website at www.asm-edmonton.org or contact us at asm.edmonton@gmail.com.  ', 'http://edmonton.eventful.com/events/asm-edmonton-educational-/E0-001-094846199-5@2016111018?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 100);
