INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1918, 'Qigong for Vitality, Power & Flexibility Fall 2016', ' Qigong is a system of whole body gestures, playing with sensitive, subtle energies flowing in, around and through the body. It helps to build your internal power by mastering your mind, breathing and channeling of universal forces.The Tao is a way of living in harmony with nature, with your true nature. It is the ancient source of acupuncture and Tai Chi. Chi Kung is Oriental Breath Therapy and energy-directing exercise. Express your creativity with vibrant and meaningful movement. These classes serve to support and deepen your personal practice and connect with a lively community. Experiencing the QI exercises over an extended period will allow you to fully reap their sustaining benefits.The class includes: Dantian Qigong - move playfully from the core, grounding and centering Tendon Nei Kung – stretch the tendons for greater flexibility and elasticity Iron Shirt Qigong - build internal strength and alignment Bone Breathing - cleanse and regenerate the bone structure Wu Wei Qigong – unwind and move spontaneously with the Qi flow Brought to you by: Minke de Vos (Senior Universal Tao Instructor) and Angel Hands Integrative Centre Minke de Vos teaches spiritual embodiment at Silent Ground Retreats, and is internationally known as one of the top teachers of Qigong, self-healing and Tao Tantric Arts. She has worked along-side of Taoist Master Mantak Chia for over 30 years. She is also a Medical Qigong Master Therapist and founder of “Feminine Treasures&quot; and “Tao Tantric Arts”. Please see about her international trainings, book and other educational products:http://silentground.com/ Date: September 12th-October 3rd (4 week series) and October 24th to December 12th 2016 (8 week series) Time: 7:30pm to 9pm *every monday  Price: $100 + GST for the 4 week series, $200 + GST for the 8 week series, $28 for Drop-In. ', 'http://vancouver.eventful.com/events/qigong-vitality-power-/E0-001-094588094-0@2016111019?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 54);
