INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1920, 'Adult Only Dance Class Registration', ' STAY FIT, PURSUE YOUR PASSION OR PERFECT YOUR ART IN A FUN & PROFESSIONAL ATMOSPHERE! The Okanagan&#39;s only Adult specialized dance training facility. Adult Only, Group Dance Classes for ages 17+, Beginner to Professional level. Ballet, Jazz, Tap and Lyrical/Contemporary. Your first class is always FREE. Sign up for the full 12wk session and save! Punch Pass options also available. Sign up online available: www.lukidance.com/adult-classes.  6.00 - 7.00PM PRIVATE CLASSES AVAIL.7.00 - 8.00PM OPEN LEVEL LYRICAL CHOREO8.00 - 9.00PM LEVEL 1 BALLET WEDNESDAY6.30 - 7.30PM NEW SCHOOL SEXY HIP HOP7.30 - 8.30PM OPEN LEVEL TAP8.30 – 9.30PM ARMY OF SASS CORPORALS THURSDAY 4.00 - 7.00PM PRIVATE CLASSES AVAIL.7.00 - 8.00PM OPEN LEVEL JAZZ8.00 - 10.00PM ON POINTE CO. FRIDAY Email: lukidancepro@gmail.com for more info! Group classes are on a first come first served basis. Maximum of 10 spots/class. All pricing plus gst.Cash, cheque & e-transfer are welcome, pricing listed below [email payments to lukidancepro@gmail.com]. Online purchases via paypal also available see below [including tax & fees]. No refunds on all class cards. Sales are final. Passes are not transferable. 5 punch passes and 10 punch passes expire 6 months after purchase. Classes are subject to enrollment numbers - should your class not run you will be given a credit towards other classes. Make-up classes from your instructor will be take place before the end of the session. EAT.SLEEP.DANCE! ', 'http://eventful.com/kelowna/events/adult-only-dance-class-regis-/E0-001-095442855-7@2016111019?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 82);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(1921, 'SOS Devoirs Fall (French-Immersion Students)', ' Votre enfant a besoin d’aide avec ses devoirs de français – SOS DEVOIRS est la solution ! SOS DEVOIRS donne la chance à votre enfant d&#39;explorer de nouvelles méthodes d&#39;apprentissage dans un environnement amusant et interactif, où les élèves acquièrent une certaine confiance en eux et dans le but de leur faire aimer la langue de Molière. Si une attention particulière est nécessaire pour votre enfant, nous demandons aux parents de nous l’indiquer sur le formulaire d’inscription. Un maximum de 6 élèves sera accepté dans chaque classe afin d’offrir une aide plus personnalisée. Après tout,  l’apprentissage ne s’arrête pas qu’à l’école ! Notre classe actuelle étant complète, nous acceptons dès maintenant vos inscriptions pour la prochaine série.  Nos prochaines classes de soutien auront lieu: Du lundi le 16 septembre au 25 novembre 2016. Les cours seront tous les lundis de 17h00 à 18h00.                                     Coût: 15 $ par séance. Les classes sont de 90 minutes.  Want your children to get help with their French homework? SOS DEVOIRS give the chance to your child to explore new learning method as we create a fun and interactive environment, where students improved their self-confidence and hopefully their love for French! SOS DEVOIRS include homework help, support in weak areas and academic enhancement. A maximum of 6 kids will be accepted per class to provide personalized and adapted support. The class starts September 12, 2016 and ends November 25, 2016. This class will take place every Monday from 5:00 to 6:00 pm for a 10-lesson program. Lessons are 90 mins each. Should you want your child (Grade 2,3 or 4 in French-Immersion) to join this new class, please register now.                                                   Au plaisir de vous voir au cours de français!                                        We look forward to welcoming you at the French lessons!  Refund & Cancellation policy: 2 weeks&#39; notice (prior the start of the series) is required for class fees to be refunded. The administration fees of $25 are not-refundable. Tickets are transferable. Have questions about SOS Devoirs Fall (French-Immersion Students)? Contact Societe Francophone de Maillardville at cstlaurent@maillardville.com ', 'http://vancouver.eventful.com/events/sos-devoirs-fall-frenchimm-/E0-001-095653892-8@2016111017?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 122);
