(2010, 'Jacob Marley''s Christmas Carol, by Tom Mula', ' Follow Jacob Marley&#39;s heroic behind-the-scenes efforts to save the soul of Scrooge, everyones favorite curmudgeonand in the process, save his own. This irreverent, funny and, ultimately, deeply moving story retells Dickens&#39; Christmas Carol with warmth and infectious zest. Its great fun, an audience pleaser filled with laughs and capped with, of course, a happy ending...among the best evenings of the theatrical year! Chicago Tribune DEC 10: live-description performance for the partially sighted and blind DEC 17: ASL-interpreted performance for the Deaf (sponsored by Haywood Real Estate) Directed by Guy Fauchon, stage managed by Susan Currie, and starring Laura Di Cicco, Beth Gunderson, David C. Jones, and Adam Francis Proulx.<br> <br> 
