INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(2033, 'Sign & Sing At Play! (Treasure Island Toys)', ' Learn to sign about &quot;animals&quot;, &quot;toys&quot;, &quot;manners&quot;, &quot;outside&quot; and more in this fun 4 week class Long before your baby can speak, they have the ability to understand speech and they want to communicate with you. Typically babies are able to sign back to you between 9 and 11 months of age but can understand much of what you sign to them before that!  Since 2001, WeeHands has been an industry-leading children&#39;s sign language and language development program delivered through interactive, fun classes, as well as a line of tailored products. In 2014, WeeHands became part of Morneau Shepell’s Children’s Support Solutions, an organization that provides health-centered and educational services to children with differences to help them reach their potential.  Instructor: Katherine Fisher $80 per family (baby and 2 caregivers) A minimum of 75 ASL signs taught over FOUR 45 mins. classes  Learning to sign with your baby is as easy as waving &quot;bye-bye&quot; Improves language and vocabulary development! Lessens babies frustration and crying! Families are encouraged to register and come together! Appropriate for infants 0-12 months (the earlier you start, the better!) ', 'http://toronto.eventful.com/events/sign-sing-play-treasure-/E0-001-094774161-8@2016111010?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, NULL);
