(2034, 'SandyBone & The BreakDown', ' The End of the Line jam is best little jam on a Tuesday night in the whole darn city far as I&#39;m concerned! For 10 years and counting Double D and yours truly have been hosting this night and it is a second home for us and the many who come to indulge. The music is always first and always great and the rest just follows naturally. Folks arrive from all around the world and find there way to The Prinny and our stage, go figure...Check it out if you haven&#39;t already and if you have, well, you know of what I speak. See y&#39;all down the line!', 'http://vancouver.eventful.com/events/sandybone-breakdown-/E0-001-097088830-6@2016111520?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, NULL);
INSERT INTO evenement
(noEvenement, titre, description, siteWeb, duree, imageAffiche, noCategorie)
VALUES
(2035, 'Digital Discovery', ' With the evolution of modern technologies, having a strong online digital footprint has become more important than ever. While digital marketing can be considered the soul of today’s marketplace, UI and UX are increasingly popular features of the digital landscape. In partnership with RED Academy, the Launch Zone is hosting five (5) introductory courses on various technical and digital marketing skills! If you attend three (3) out of five (5) sessions, you will receive a letter of recognition which will provide you with a ONE TIME $500 discount on full-time courses or a $250 discount on part-time courses. All sessions will be lead by the dynamic instructors of RED Academy and will cover the following topics: Introduction to Web Development (October 26):  In this session, you&#39;ll learn the basics of HTML and CSS, build a functional webpage from scratch and collaborate with people just like you. With a focus on hands-on learning, you will learn about mark-up language, semantic HTML, the relation between CSS and HTML and how to use CSS to adjust HTML on a webpage. Introduction to User Interface Design (November 2):  With today’s growing consumer expectations of flawless, high quality web experiences, the caliber of the UI Design can be what makes or breaks the success of a business. In this session, you will learn about human-centric design thinking and the foundational principles of graphic and interaction design. Introduction to User Experience Design (November 9):  The relationship between good UX and successful websites has become extremely evident, making UX skills high in demand. In this session, you will learn about the role that UX designers play in relation to other web disciplines. You&#39;ll also discover why design is about much more than how a website looks and what it takes to craft user centred design experiences that align with business objectives.  Introduction to Google AdWords (November 16): AdWords (Google AdWords) is an advertising service by Google for businesses wanting to display ads on Google and its advertising network. In this session, you will understand the inner workings of AdWords, including the bidding process and quality scored. You will learn how to research keywords to target using Google&#39;s Keyword Planner and create your first ad groups, ads and A/B split tests to being advertising. Introduction to Google Analytics (November 23):   As a new field, digital marketing is changing rapidly, it’s more than a simple tweet, Facebook or linked post, digital marketers can harness the power of analytics tools to see where the money is going, and measure where customers are buying, offering effective insight to businesses that positively affect the bottom line. This session will cover the basics of the Google Analytics tool. Please note: all sessions are BYOL (bring your own laptop). ', 'http://toronto.eventful.com/events/digital-discovery-/E0-001-096266965-4@2016111018?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 59);
