(2037, 'Shine Your Light ~ Led by Sherry Selley', ' Shine Your Light is an 8 week series of meditation,lessons, rituals,sisterhood and acceptance. This series runs every Wednesday     Oct 26 th  to Dec 14th from         7pm - 8pm&quot;Sherry did a great job in outlining how she intend to present this information to her students and work with them toward their own understanding.Her 8 Week Meditation Program demonstrates a very practical understanding and her meditation students will be well-served by her very unique approach to her teaching.&quot;Stephen Rinaldi, D.MT.C.MI. Author & DirectorUniversity of Holistic Theology  Investment in Self $160 for the 8 week series                                                                            Find our website at www.TribeMeditation.com  ', 'http://eventful.com/winnipeg/events/shine-your-light-led-sherr-/E0-001-096604069-9@2016111019?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 54);
