(2159, 'Jimmy Webb', ' <a href="http://hughsroom.com/wordpress/wp-content/uploads/2016/09/jimmy-webb.png" rel="nofollow"></a><blockquote><p>“Few singers blend grit and grandeur like Jimmy Webb…[his] voice is like an old Mustang heading through a treacherous yet often gorgeous landscape.” — Rolling Stone</p></blockquote><br><blockquote><p>“At an age when other singers are losing their voices, Mr. Webb finds his mercurial, unguarded, singing…attaining the gritty authority of a softhearted country outlaw’s…Mr. Webb is still at the top of his game.”<br> — Stephen Holden, The New York Times</p></blockquote><p> <p><a href="http://www.jimmywebb.com/" rel="nofollow"><strong>Jimmy Webb</strong></a> is an American songwriter, composer, and singer known worldwide as a master of his trade. His platinum selling classics include “Up, Up and Away”, “By the Time I Get to Phoenix,” “Wichita Lineman”, “Galveston”, “The Worst that Could Happen”, “All I Know”, and “MacArthur Park”. His songs have been recorded or performed by the best including Frank Sinatra, Elvis Presley, Judy Collins, Isaac Hayes, Art Garfunkel, Linda Ronstadt, R.E.M., Michael Feinstein, and Carly Simon.  According to BMI, his song  “By the Time I Get to Phoenix” was the third most performed song in the 50 years between 1940 to 1990.  Webb is the only artist ever to have received Grammy Awards for music, lyrics, and orchestration.<p>Jimmy Webb was the youngest man ever inducted into the National Songwriters’ Hall of Fame and is the current Chairman.  He also serves proudly as the Vice Chair of ASCAP.  He is dedicated to the preserving the rights and the craft of the songwriter.<p>His book, <a href="http://tinyurl.com/kgvutv7" rel="nofollow">Tunesmith: Inside the Art of Songwriting</a>, in addition to being a good read, is considered a “bible” among musicians.<p>Webb’s latest CD, the critically acclaimed “Still Within the Sound of My Voice” (September 2013) features duets that punctuate the importance of this songwriter: Brian Wilson, Keith Urban, Lyle Lovett, David Crosby and Graham Nash, Art Garfunkel, and more.  It is the follow up to the 2010 release, “Just Across the River” featuring duets with friends including Billy Joel, Vince Gill, Willie Nelson, Jackson Browne and Glen Campbell.<p>Webb is married to Laura Savini, PBS host and producer. He has five talented sons and a princess of a daughter.<br></p></p></p></p></p></p>', 'http://toronto.eventful.com/events/jimmy-webb-/E0-001-096401824-3?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, NULL);
