(2185, 'TSO - Disney-Pixar Ratatouille in Concert', ' TSO - Disney-Pixar Ratatouille in Concert<p><strong>Sarah Hicks</strong>, conductor<br><br>One of Disney and Pixar’s most enchanting animated fables tells the hilarious story of a rodent’s quest to become a top Parisian chef. Hearing Michael Giacchino’s sprightly score performed live by the TSO boosts the film’s charm to a new level. A perfect part of your Family Day weekend! <br><br>Presentation licensed by Disney Music Publishing and Buena Vista Concerts, a division of ABC Inc.<br><br>© All rights reserved.<br><br><strong></strong>var eventid=2384;</p>', 'http://toronto.eventful.com/events/tso-disneypixar-ratatoui-/E0-001-095498977-5@2017021811?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 31);
