(2230, 'Hi/Lo GameShow at the View Royal Casino', ' Every Saturday starting September 9th @ 8pm. Swipe your Encore card at the Promo Zone to receive entries, any day, any time. Saturday night at 8pm we will draw one name to play the Hi-Lo Game Show LIVE! The selected winner will automatically win $500 minimum but can play their way up to $2,500.', 'http://eventful.com/events/hilo-gameshow-view-royal-casino-/E0-001-044104077-0?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 63);
