(2234, 'Trivia Night at Brentwood Bay Resort', ' Join us for Trivia Night in the Pub! Our Quizmaster Andrew will lead three rounds of questions - Arts & Entertainment, Sports & Leisure, and Anything Goes! Teams of 4 battle for the top spot, and the monthly prize! Sponsored by Hoyne Brewing Co. Check brentwoodbayresort.com/events for updated prize information. We hope to see you there!', 'http://eventful.com/events/trivia-night-brentwood-bay-resort-/E0-001-043110084-2?utm_source=apis&utm_medium=apim&utm_campaign=apic', NULL, 63);
